INSERT INTO `pages_description` (`page_description_id`, `name`, `description`, `language_id`, `page_id`) VALUES
(1, 'Privacy Policy', '<h1><strong>Privacy Policy</strong></h1>\r\n\r\n<p><strong>We thank you for visiting our website nadaalazhar.com</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We here at Tswooq.com E-commerce website. Ltd. strive to do everything in our power to gain the confidence of customers when they purchase our multiple products that carry our trademark, and we here confirm our commitment that your privacy as a customer has no limits, in addition to that, we are also committed to protecting the privacy of the consumer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We are pleased, Abdul Latif Jameel Electronics Company, will provide information to all customers about the privacy policy on the Internet, and here we assure our customers that Tswooq.com E-commerce website is doing its best to protect the privacy of visitors to this site.</p>\r\n\r\n<p><strong>The types of information we collect and how we use it:</strong></p>\r\n\r\n<p><br />\r\nTswooq.com collects personal information, such as:&nbsp;</p>\r\n\r\n<p>first and last name (family), mailing address, and e-mail addresses. Certainly, this information is provided by the customer voluntarily and at your choice. For example: We collect personal information from you in order to obtain your comments on websites and express your opinions about our products, or if you enter one of our contests or raffles that we do.</p>\r\n\r\n<p><strong>Sharing personal information:</strong></p>\r\n\r\n<p><br />\r\nTswooq.com may share your personal information only within the Tswooq.com Corporation for Electronics and its affiliated companies, and of course any use of this information by Tswooq.com will comply with this policy, sometimes and after obtaining your permission we will send you marketing information, such as coupons, discounts, information on new product offers, etc. And, if you are not chosen to receive such information, Tswooq.com represented by nadaalazhar.com can assign some companies to perform a variety of functions such as: executing work orders, assisting in promotions, providing technical services for websites, etc. These companies can access the client&rsquo;s personal information if necessary to perform such tasks, and therefore such companies adhere to the privacy policy when using such personal information for the purpose of performing that job assigned to the company and therefore this personal information cannot be used for any other purpose.</p>\r\n\r\n<p>Tswooq, represented by Tswooq.com, is committed not to sell, transfer or disclose the customer&rsquo;s personal information to any third parties outside the organization, however, after obtaining permission from the customer, we sometimes send marketing information on behalf of one of our business partners about the products or services that we provide that may be of interest to the customer. Here, you may be asked if you want to receive the marketing materials fromTswooq.com Est or not. If you choose to receive these marketing materials, Tswooq.com in this case will not share your personal information with these partners, but will send these marketing materials by regular mail or via e-mail on behalf of the partners.</p>\r\n\r\n<p>Tswooq.com reserves the right to use or disclose any information. As needed to meet the requirements and instructions of any law, regulation or lawsuit, or to protect the integrity of the site, or to fulfill your requests, or to cooperate with the competent authorities in the investigation and enforcement of applicable laws or the investigation of a matter of public safety.<br />\r\n<br />\r\nIf we change the privacy policy, we will update the changes on this page, and we will put notes on other pages of the site so that you can at any time check our current policy, but if we want to make any changes that may significantly affect the way we deal with your information, We will also notify you of the changes made, so you may have your details removed from our records if you do not agree with these changes.</p>\r\n\r\n<p>How to call flowering dew<br />\r\nWe welcome your views on our website and privacy policy, if you would like to contact us or have any questions or comments please send an email to:</p>\r\n\r\n<p>support@tswooq.com</p>\r\n\r\n<p>or phone: 0536990111.</p>', 1, 1),
(2, 'سياسة الخصوصية', '<h1>سياسة الخصوصية</h1>\r\n\r\n<p><strong>نشكرك على زيارة موقعنا على الإنترنت </strong></p>\r\n\r\n<p><strong>Tswooq.com</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>نحن هنا في شركة<strong> تسوق.كوم&nbsp;</strong> نسعى جاهدين لبذل كل ما في وسعنا لكسب ثقة العملاء عند شراء منتجاتنا المتعددة التي تحمل علامتنا التجارية ، ونؤكد هنا التزامنا بأن خصوصيتك كعميل ليس له حدود ، بالإضافة إلى ذلك ، نحن ملتزمون أيضًا بحماية خصوصية المستهلك.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>يسعدنا أن شركة عبد اللطيف جميل للإلكترونيات ستوفر معلومات لجميع العملاء حول سياسة الخصوصية على الإنترنت ، وهنا نؤكد لعملائنا أن شركة <strong>تسوق.كوم</strong> للإلكترونيات تبذل قصارى جهدها لحماية خصوصية زوار هذا الموقع.</p>\r\n\r\n<p><strong>أنواع المعلومات التي نجمعها وكيف نستخدمها:</strong></p>\r\n\r\n<p><br />\r\nيجمع موقع Tswooq.com معلومات شخصية ، مثل:&nbsp;</p>\r\n\r\n<p>الاسم الأول والأخير (العائلة) والعنوان البريدي وعناوين البريد الإلكتروني. بالتأكيد ، يتم توفير هذه المعلومات من قبل العميل طواعية وبناءً على اختيارك. على سبيل المثال: نقوم بجمع معلومات شخصية منك من أجل الحصول على تعليقاتك على مواقع الويب والتعبير عن آرائك حول منتجاتنا ، أو إذا شاركت في إحدى مسابقاتنا أو السحوبات التي نقوم بها.</p>\r\n\r\n<p><strong>تبادل المعلومات الشخصية:</strong></p>\r\n\r\n<p><br />\r\nقد يقوم موقع Tswooq.com بمشاركة معلوماتك الشخصية فقط داخل مؤسسة تسوق.كوم والشركات التابعة لها ، وبالطبع أي استخدام لهذه المعلومات من قبل ندى الأزهر سوف يتوافق مع هذه السياسة ، وفي بعض الأحيان وبعد الحصول على إذن منك سوف نقوم بذلك. إرسال معلومات تسويقية لك ، مثل القسائم والخصومات ومعلومات عن عروض المنتجات الجديدة وما إلى ذلك ، وإذا لم يتم اختيارك لتلقي مثل هذه المعلومات ، يمكن ل التي يمثلها موقع Tswooq.com تعيين بعض الشركات لأداء مجموعة متنوعة من الوظائف مثل: تنفيذ أوامر العمل ، والمساعدة في العروض الترويجية ، وتقديم الخدمات الفنية للمواقع الإلكترونية ، وما إلى ذلك. يمكن لهذه الشركات الوصول إلى المعلومات الشخصية للعميل إذا لزم الأمر لأداء مثل هذه المهام ،وبالتالي تلتزم هذه الشركات بسياسة الخصوصية عند استخدام هذه المعلومات الشخصية لغرض أداء تلك الوظيفة المعينة للشركة ، وبالتالي لا يمكن استخدام هذه المعلومات الشخصية لأي غرض آخر.</p>\r\n\r\n<p>تلتزم شركة تسوق.كوم ، ممثلة بـ Tswooq.com ، بعدم بيع أو نقل أو الكشف عن المعلومات الشخصية للعميل إلى أي طرف ثالث خارج المنظمة ، ومع ذلك ، بعد الحصول على إذن من العميل ، نرسل أحيانًا معلومات تسويقية نيابة عن أحد من شركائنا في العمل حول المنتجات أو الخدمات التي نقدمها والتي قد تهم العميل. هنا ، قد يتم سؤالك عما إذا كنت ترغب في استلام المواد التسويقية من مؤسسة تسوق.كوم أم لا. إذا اخترت تلقي هذه المواد التسويقية ، فلن تشارك تسوق.كوم في هذه الحالة معلوماتك الشخصية مع هؤلاء الشركاء ، ولكنها سترسل هذه المواد التسويقية عن طريق البريد العادي أو عبر البريد الإلكتروني نيابة عن الشركاء.</p>\r\n\r\n<p>تحتفظ شركة تسوق.كوم بالحق في استخدام أو الكشف عن أي معلومات. حسب الحاجة لتلبية متطلبات وتعليمات أي قانون أو لائحة أو دعوى قضائية ، أو لحماية سلامة الموقع ، أو لتلبية طلباتك ، أو للتعاون مع السلطات المختصة في التحقيق وإنفاذ القوانين المعمول بها أو التحقيق في مسألة تتعلق بالسلامة العامة.<br />\r\n<br />\r\nإذا قمنا بتغيير سياسة الخصوصية ، فسنقوم بتحديث التغييرات على هذه الصفحة ، وسنضع ملاحظات على صفحات أخرى من الموقع حتى تتمكن في أي وقت من التحقق من سياستنا الحالية ، ولكن إذا أردنا إجراء أي تغييرات قد تكون كبيرة تؤثر على الطريقة التي نتعامل بها مع معلوماتك ، وسنخطرك أيضًا بالتغييرات التي تم إجراؤها ، لذلك قد تتم إزالة التفاصيل الخاصة بك من سجلاتنا إذا كنت لا توافق على هذه التغييرات.</p>\r\n\r\n<p>كيفية الاتصال بتسوق.كوم<br />\r\nنرحب بآرائكم على موقعنا الإلكتروني وسياسة الخصوصية ، إذا كنت ترغب في الاتصال بنا أو لديك أي أسئلة أو تعليقات ، يرجى إرسال بريد إلكتروني إلى:</p>\r\n\r\n<p>support@tswooq.com</p>\r\n\r\n<p>او الهاتف: 0536990111.</p>', 2, 1),
(3, 'Refund Policy', '<h1>REFUND POLICY</h1>\r\n\r\n<p><strong>Return merchandise</strong><br />\r\n<strong>Return and exchange</strong></p>\r\n\r\n<p>&bull; The exchange and return includes all types of mobile and electronic devices, provided that there are no damages</p>\r\n\r\n<p>&bull; It is possible to exchange and return if the product is in the same condition when purchased and wrapped with the factory cover</p>\r\n\r\n<p>&bull; The customer has the right to return the product within 3 days from the date of purchase, and the product can be replaced within 7 days.<br />\r\nImmediate replacement of devices with factory defects<br />\r\nTswooq.com stores replace any device (in case of a manufacturing defect) with a new device identical to the replaced device within 3 days from the date of receipt, in the following cases: &ndash;</p>\r\n\r\n<p>&bull; The device should be free from scratches or misuse</p>\r\n\r\n<p>&bull; Bring the original box with all accessories and use guide inside it.</p>\r\n\r\n<p><strong>Exceptions:</strong></p>\r\n\r\n<p>&ndash; Software a. Video games are not refundable.</p>\r\n\r\n<p>&ndash; Products that were installed and not covered by the return policy, unless they were damaged, will be repaired or subject to the return policy.</p>\r\n\r\n<p>&ndash; Mobile phones, computers, and game devices are not subject to refund, exchange, or refund unless they are defective within seven days.</p>\r\n\r\n<p>&ndash; Data cards that can be activated or the router are not subject to a refund or refund unless they are defective within seven days.</p>\r\n\r\n<p>&ndash; The accessory is not subject to return, exchange or refund unless it is defective within seven days.</p>\r\n\r\n<p>&ndash; Please contact us to obtain a product return authorization number before completing the return process, and this number is valid for seven days from the date of issue.</p>\r\n\r\n<p>&ndash; In the event that the product is returned due to a manufacturing defect or operation defect, or damage to the product during delivery or the delivery of a wrong product, the customer will not bear any expenses related to shipping or bank transfer expenses (20 riyals), and in the event of returning the product for other reasons ( For example: the customer&rsquo;s need to replace or change the customer&rsquo;s opinion) The customer in this case bears the shipping fees and bank transfer expenses.</p>\r\n\r\n<p>&ndash; During preparation for the retrieval, the product must be in its original packaging with all the accessories and evidence, we will not accept the return of products that have scratches, or damaged due to misuse or operation due to delivery with a wrong effort, and based on the company&rsquo;s sole discretion, the company studies the returned goods It does not meet the following criteria:<br />\r\nPhysical return of products</p>\r\n\r\n<p>&ndash; Please contact the customer service team in order to go to bring the product &ndash; In the event that the product is received by the Nada Al-Azhar team, the team will set an appointment to collect the goods.</p>\r\n\r\n<p>&ndash; In the event that the product is received from Naqel, the customer service team will bring the product from Naqel, who will call the customer to collect the product.</p>\r\n\r\n<p>&ndash; In the event that you collect the product from one of our branches, you must go directly to the store. &ndash; The license number must be attached to the product being returned, the product number must appear in the shipping documents, failure to do so will delay the process.</p>\r\n\r\n<p>&ndash; Once the unit is retrieved, the company will inspect the product for replacement, or refund the amount, after an examination by the company&rsquo;s technician regarding the packing conditions, complete accessory examination, technical examination of the product, obtaining the approval of the line manager, rejecting the return and rejecting the replacement or refund a refund.</p>', 1, 2),
(4, 'سياسة الإسترجاع', '<h1>سياسة الاسترجاع</h1>\r\n\r\n<p><strong>إرجاع البضائع </strong><br />\r\n<strong>والاستبدال</strong></p>\r\n\r\n<p>&bull; يشمل الاستبدال والإرجاع جميع أنواع الأجهزة المحمولة والإلكترونية بشرط عدم وجود أضرار</p>\r\n\r\n<p>&bull; يمكن الاستبدال والإرجاع إذا كان المنتج في نفس الحالة عند شرائه وتغليفه بغطاء المصنع</p>\r\n\r\n<p>&bull; يحق للعميل إرجاع المنتج خلال 3 أيام من تاريخ الشراء ، ويمكن استبدال المنتج خلال 7 أيام.<br />\r\nالاستبدال الفوري للأجهزة بعيوب المصنع -<br />\r\nتسوق.كوم - استبدال أي جهاز (في حالة وجود عيب في التصنيع) بجهاز جديد مطابق للجهاز المستبدل خلال 3 أيام من تاريخ الاستلام ، في الحالات التالية: -</p>\r\n\r\n<p>&bull; يجب أن يكون الجهاز خالي من الخدوش أو سوء الاستخدام</p>\r\n\r\n<p>&bull; أحضر العلبة الأصلية مع جميع الملحقات ودليل الاستخدام بداخلها.</p>\r\n\r\n<p><strong>استثناءات:</strong></p>\r\n\r\n<p>- البرمجيات أ. ألعاب الفيديو غير قابلة للاسترداد.</p>\r\n\r\n<p>- المنتجات التي تم تثبيتها ولا تغطيها سياسة الإرجاع ، ما لم تكن تالفة ، سيتم إصلاحها أو تخضع لسياسة الإرجاع.</p>\r\n\r\n<p>- لا تخضع الهواتف المحمولة وأجهزة الكمبيوتر وأجهزة الألعاب للاسترداد أو الاستبدال أو الاسترداد ما لم تكن معيبة في غضون سبعة أيام.</p>\r\n\r\n<p>- بطاقات البيانات التي يمكن تفعيلها أو جهاز التوجيه غير قابلة للاسترداد أو الاسترداد ما لم تكن معيبة في غضون سبعة أيام.</p>\r\n\r\n<p>- لا يخضع الملحق للإرجاع أو الاستبدال أو الاسترداد ما لم يكن معيبًا خلال سبعة أيام.</p>\r\n\r\n<p>- يرجى الاتصال بنا للحصول على رقم ترخيص إرجاع المنتج قبل إتمام عملية الإرجاع ، وهذا الرقم صالح لمدة سبعة أيام من تاريخ الإصدار.</p>\r\n\r\n<p>- في حال إرجاع المنتج بسبب عيب في التصنيع أو عيب في التشغيل ، أو تلف المنتج أثناء التسليم أو تسليم منتج خاطئ ، فلن يتحمل العميل أي مصاريف تتعلق بمصاريف الشحن أو التحويل البنكي (20 ريالاً) ) وفي حالة إعادة المنتج لأسباب أخرى (على سبيل المثال: حاجة العميل إلى استبدال أو تغيير رأي العميل) يتحمل العميل في هذه الحالة رسوم الشحن ومصاريف التحويل البنكي.</p>\r\n\r\n<p>- أثناء التحضير للاسترجاع ، يجب أن يكون المنتج في عبوته الأصلية مع جميع الملحقات والأدلة ، ولن نقبل إرجاع المنتجات التي بها خدوش ، أو التالفة بسبب سوء الاستخدام أو التشغيل بسبب التسليم بجهد خاطئ ، و بناءً على تقدير الشركة وحدها ، تدرس الشركة البضائع المعادة ولا تستوفي المعايير التالية:<br />\r\nالإرجاع المادي للمنتجات</p>\r\n\r\n<p>- يرجى الاتصال بفريق خدمة العملاء للذهاب لإحضار المنتج. - في حالة استلام فريق ندى الأزهر للمنتج ، سيحدد الفريق موعدًا لاستلام البضاعة.</p>\r\n\r\n<p>- في حال استلام المنتج من ناقل يقوم فريق خدمة العملاء بإحضار المنتج من ناقل والذي سيتصل بالعميل لاستلام المنتج.</p>\r\n\r\n<p>- في حالة استلامك للمنتج من أحد فروعنا ، يجب عليك التوجه مباشرة إلى المتجر. - يجب إرفاق رقم الترخيص بالمنتج الذي يتم إرجاعه ، ويجب أن يظهر رقم المنتج في مستندات الشحن ، وسيؤدي عدم القيام بذلك إلى تأخير العملية.</p>\r\n\r\n<p>- بمجرد استرجاع الوحدة ، ستقوم الشركة بفحص المنتج لاستبداله ، أو استرداد المبلغ ، بعد فحص من قبل فني الشركة فيما يتعلق بشروط التعبئة ، والفحص الكامل للملحقات ، والفحص الفني للمنتج ، والحصول على موافقة المدير المباشر ورفض الإرجاع ورفض الاستبدال أو استرداد المبلغ المدفوع.</p>', 2, 2),
(5, 'Terms & Conditions', '<h1>TERMS &amp; CONDITIONS</h1>\r\n\r\n<p><strong>1.</strong> <strong>Our contract: </strong></p>\r\n\r\n<p>&nbsp;These terms and conditions (site terms) apply to your use of the domain www.tswooq.com on the Internet (the site) and this term must include all the contents on the site, and you must read these terms carefully, and we recommend that you print and keep a copy for future reference, if Your entry, browsing, use or registration on the site confirms your reading, understanding and agreement to the terms of the entire site, and if you do not agree to the terms of this site in its entirety, you must not use the site.<br />\r\nThe processing of the payment process and the acknowledgment of obtaining the purchase requisition does not constitute legal acceptance of the order. We are obligated to provide very accurate prices on our website, however, errors may occur that may result in incorrectly quoting a product. In such cases, we reserve the right to refuse or cancel any order. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. Privacy and Cookie Policy:</strong>&bull; These conditions attached to the site (which are in addition to) the terms of the privacy policy and the cookie policy, as our privacy policy explains what personal information we collect about you when you use the site and our cookie policy deals with the use of cookies on the site, and you can see the privacy policy And the cookie policy by clicking here. &bull; When you agree to the terms of the site, you will also be deemed to have read, understood and agreed to our terms of privacy and cookies in full<strong>.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. Terms and conditions for sales:</strong></p>\r\n\r\n<ul>\r\n	<li>In the event that you order a product through the site, our terms and conditions for sales will also be applied, and you can view these terms and conditions here.</li>\r\n</ul>\r\n\r\n<p>All purchase orders and the purchase of goods (whether from the warehouse, by phone, through the website, or through any other means we allow) are submitted according to these terms and conditions, subject to the approval issued by us through (as applicable): (1) Delivery of the goods to the customer, or (2) delivery of the goods that the customer purchased to his location, to the point specified in the contract agreed upon between the parties.</p>\r\n\r\n<p>&bull; The processing of the payment process and the approval of obtaining the purchase order does not represent legal acceptance of the request.</p>\r\n\r\n<p>&bull; Prices on the website are exclusively for online purchases and may not be available in the store. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. Your use of this website: </strong></p>\r\n\r\n<p>&bull; You must use this site for legitimate purposes only, and you must not use it in a way that violates the rights of any other person or restricts or prevents anyone from enjoying the services of the site. You may use, download and display the contents of this website on a computer screen and print one copy of the content, for your own personal use only or for internal commercial purposes, other than for your own personal use or internal commercial purposes, you may not do the following without obtaining our written consent Presets: &ndash;<br />\r\nCopying, reproducing, using or otherwise dealing with any content on the site. Modify, distribute or repost any content on the site for any purpose. Reproduction of this website or its frames, and extensive connection or communication on this site from any other website, application, or any other device connected to the Internet. &ndash; Using the website content for any other commercial activity whatsoever.</p>\r\n\r\n<p>&bull; You may not use the site for any of the following purposes:</p>\r\n\r\n<p>&bull; Posting any illegal content, defamation, threat, offense, obscene language, sexual suggestion, or otherwise rejected material.</p>\r\n\r\n<p>&bull;