l these documents and all these procedures and things according to what we request in an appropriate manner in order to assign these rights to us and to waive any moral rights you obtain or to the site.</p>\r\n\r\n<p><strong>7. Security, password and account: </strong>You are responsible for maintaining the privacy of your password, the security of your account, and any activities that occur under your account. We are not responsible for any losses or damages that may occur as a result of any failure by you to protect your password and the security of your account.&nbsp;</p>\r\n\r\n<p><strong>8. Availability of the website:</strong></p>\r\n\r\n<p>&bull; We cannot promise that the services on the site will be permanently free of errors, and in the event of a service error, please report it to our customer services team at: info@Tswooq.com, and we will try to correct the error as soon as we can.</p>\r\n\r\n<ul>\r\n	<li>Access to the site may sometimes be restricted or limited to enable repairs, upgrades or general maintenance. We will endeavor to regain access as soon as possible.</li>\r\n</ul>\r\n\r\n<p><strong>9. Damage to your equipment or other devices:</strong></p>\r\n\r\n<p>&bull; Tswooq.com makes appropriate efforts to ensure that this website is free from viruses and other harmful content. In general, we do not guarantee that your use of this website (including any content on it or any website that can be accessed through it) will not cause any damage to your computer or other devices.</p>\r\n\r\n<p>&bull; You will be responsible for ensuring the availability of appropriate equipment and software (including anti-virus software) to use the site safely and securely and to filter anything that may harm your computer or other devices. We will not be liable to any person for any losses or damages incurred as a result of viruses or other harmful content that enters from or through the site.</p>\r\n\r\n<p>&bull; We have provided links and links to this site in order 