te.</p>\r\n\r\n<p>&bull; The terms of these sites should not limit or exclude any liability that we are not authorized to limit or exclude under applicable law (such as death or personal injury).</p>\r\n\r\n<p><strong>13. Protection:</strong></p>\r\n\r\n<p>You will be responsible for protecting us against all losses, liabilities, and expenses that are appropriately incurred or incurred by us, all compensation awarded against us under any judgment by any court of jurisdiction and any sums paid by us as a result of any settlement agreed upon. By us resulting from or in connection with:- Any claim or allegation from any third party that your use of the site is defamatory, offensive, bullying, or offensive, or of a pornographic nature, or is illegal or constitutes a breach of any law, regulation or code of conduct. Any claim by any third party that your use of this website violates the rights of that third party. &ndash;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Copyright or other intellectual property rights of whatever nature. &ndash; Any fines or penalties imposed by any regulatory, advertising or commercial authority in connection with the use of this site by you.</p>\r\n\r\n<p><strong>14. The comprehensive</strong></p>\r\n\r\n<p>agreement: The terms of these sites (including our policies regarding privacy, cookie policy and terms and conditions of sale) define and clarify the comprehensive and complete agreement between you and us and supersede any and all previous terms, conditions, warranties and / or undertakings to the maximum extent permitted by law.<br />\r\n<br />\r\n<strong>15. Changes to the terms and conditions of this website:</strong>&nbsp;</p>\r\n\r\n<p>We reserve the right to change and update the terms and conditions of this website from time to time. We recommend that you visit this page regularly to be informed and updated on the latest developments in the terms and conditions. Your continued access to, browsing, and use of this site means your agreement to any changes or updates to the terms and conditions of our site.</p>\r\n\r\n<p><strong>16. Terms and conditions of installation: </strong><br />\r\n<br />\r\n&bull; The product will be delivered within 7 working days from the date of purchase.</p>\r\n\r\n<p>&bull; No maintenance will be done for the product<br />\r\n<br />\r\n<strong>17. Various terms and conditions:</strong>&nbsp;</p>\r\n\r\n<p>&bull; In the event that any of the terms and conditions of this website are not valid according to a decision from any court of jurisdiction, the invalidity of this condition will not affect the validity of the remaining terms of the terms and conditions of this site, and it must remain in full effectiveness, validity and influence.&nbsp; &nbsp;<br />\r\n<br />\r\n&bull; This website is owned and operated by Tswooq.com, which is an establishment registered in the Kingdom of Saudi Arabia (Commercial Registration No. 2250053429), whose address is Al-Ahsa, Al-Omran, Al-Baladiah Street, Kingdom of Saudi Arabia.<br />\r\n<br />\r\n&bull; Tswooq.com, meaning Tswooq.com Est. All rights in this website are fully reserved. Permission is granted to use this website in accordance with the terms of use. The term &ldquo;flower dew&rdquo; indicates-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &bull; All prices shown on the Tswooq.com website do not include installment customers who are subject to the installment agreement concluded with us and subject to their terms and conditions.</p>\r\n\r\n<p>&nbsp;</p>', 1, 3),
(6, 'الشروط و الأحكام', '<h1>البنود و الظروف</h1>\r\n\r\n<p><strong>1. </strong> <strong>عقدنا:</strong></p>\r\n\r\n<p>&nbsp;تنطبق هذه الشروط والأحكام (شروط الموقع) على استخدامك لمجال www.Tswooq.com على الإنترنت (الموقع) ويجب أن يشمل هذا المصطلح جميع محتويات الموقع ، ويجب عليك قراءة هذه الشروط بعناية ، ونحن نوصي أن تطبع وتحتفظ بنسخة للرجوع إليها في المستقبل ، إذا كان دخولك أو تصفحك أو استخدامك أو تسجيلك على الموقع يؤكد قراءتك وفهمك وموافقتك على شروط الموقع بالكامل ، وإذا كنت لا توافق على شروط هذا الموقع في مجمله ، لا يجوز لك استخدام الموقع.<br />\r\nلا تشكل معالجة عملية الدفع والإقرار بالحصول على طلب الشراء قبولًا قانونيًا للأمر. نحن ملزمون بتقديم أسعار دقيقة للغاية على موقعنا ، ومع ذلك ، قد تحدث أخطاء قد تؤدي إلى عرض أسعار غير صحيح لمنتج. في مثل هذه الحالات ، نحتفظ بالحق في رفض أو إلغاء أي طلب. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. سياسة الخصوصية وملفات تعريف الارتباط:</strong> &bull; هذه الشروط المرفقة بالموقع (بالإضافة إلى) شروط سياسة الخصوصية وسياسة ملفات تعريف الارتباط ، حيث توضح سياسة الخصوصية الخاصة بنا ما هي المعلومات الشخصية التي نجمعها عنك عند استخدامك للموقع و تتعامل سياسة ملفات تعريف الارتباط الخاصة بنا مع استخدام ملفات تعريف الارتباط على الموقع ، ويمكنك الاطلاع على سياسة الخصوصية وسياسة ملفات تعريف الارتباط بالنقر هنا. &bull; عندما توافق على شروط الموقع ، سيتم اعتبارك أيضًا قد قرأت وفهمت ووافقت على شروط الخصوصية وملفات تعريف الارتباط الخاصة بنا بالكامل <strong>.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>3. أحكام وشروط المبيعات:</strong></p>\r\n\r\n<ul>\r\n	<li>في حالة قيامك بطلب منتج عبر الموقع ، سيتم أيضًا تطبيق الشروط والأحكام الخاصة بنا للمبيعات ، ويمكنك الاطلاع على هذه الشروط والأحكام هنا.</li>\r\n</ul>\r\n\r\n<p>يتم تقديم جميع طلبات الشراء وشراء البضائع (سواء من المستودع أو الهاتف أو الموقع الإلكتروني أو بأي وسيلة أخرى نسمح بها) وفقًا لهذه الشروط والأحكام ، مع مراعاة الموافقة الصادرة من قبلنا من خلال (حسب الاقتضاء) : (1) تسليم البضائع إلى العميل ، أو (2) تسليم البضائع التي اشتراها العميل إلى موقعه ، إلى النقطة المحددة في العقد المتفق عليه بين الطرفين.</p>\r\n\r\n<p>&bull; لا تمثل معالجة عملية الدفع والموافقة على الحصول على أمر الشراء قبولًا قانونيًا للطلب.</p>\r\n\r\n<p>&bull; الأسعار الموجودة على الموقع مخصصة لعمليات الشراء عبر الإنترنت حصريًا وقد لا تكون متوفرة في المتجر. &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>4. استخدامك لهذا الموقع: </strong></p>\r\n\r\n<p>&bull; يجب عليك استخدام هذا الموقع لأغراض مشروعة فقط ، ولا يجوز لك استخدامه بطريقة تنتهك حقوق أي شخص آخر أو تقيد أو تمنع أي شخص من الاستمتاع بخدمات الموقع. يجوز لك استخدام محتويات هذا الموقع وتنزيلها وعرضها على شاشة الكمبيوتر وطباعة نسخة واحدة من المحتوى ، لاستخدامك الشخصي فقط أو لأغراض تجارية داخلية ، بخلاف استخدامك الشخصي أو للأغراض التجارية الداخلية ، يجوز لك لا تقم بما يلي دون الحصول على موافقة كتابية مسبقة: -<br />\r\nنسخ أو إعادة إنتاج أو استخدام أو التعامل بأي شكل من الأشكال مع أي محتوى على الموقع. تعديل أو توزيع أو إعادة نشر أي محتوى على الموقع لأي غرض. إعادة إنتاج هذا الموقع أو إطاراته ، واتصال أو اتصال واسع النطاق على هذا الموقع من أي موقع ويب آخر أو تطبيق أو أي جهاز آخر متصل بالإنترنت. - استخدام محتوى الموقع لأي نشاط تجاري آخر مهما كان نوعه.</p>\r\n\r\n<p>&bull; لا يجوز لك استخدام الموقع لأي من الأغراض التالية:</p>\r\n\r\n<p>&bull; نشر أي محتوى غير قانوني ، أو تشهير ، أو تهديد ، أو إساءة ، أو لغة بذيئة ، أو اقتراح جنسي ، أو مواد مرفوضة بأي شكل آخر.</p>\r\n\r\n<p>&bull; إرسال أو إرسال مواد تشجع السلوك الذي يشكل جريمة جنائية ، أو يؤدي إلى مسؤولية مدنية أو ينتهك أي قوانين أو لوائح أو مدونات قواعد الممارسة.</p>\r\n\r\n<p>&bull; الوصول غير المصرح به إلى أنظمة الكمبيوتر الخاصة بنا أو أنظمة الكمبيوتر الخاصة بالآخرين.</p>\r\n\r\n<p>&bull; التدخل في استخدام أو استمتاع أي شخص آخر بالموقع أو الإنترنت.</p>\r\n\r\n<p>&bull; التدخل في أو تعطيل الشبكات أو مواقع الإنترنت المتصلة بالموقع. &bull; تصنيع أو إرسال أو تخزين نسخ إلكترونية من المواد المحمية بموجب حقوق النشر.&nbsp;</p>\r\n\r\n<p><strong>5. استخدام الموقع من خارج المملكة العربية السعودية:</strong></p>\r\n\r\n<p>باستثناء ما هو منصوص عليه بخلاف ذلك في هذا الموقع ، يتم عرض المواد الموجودة على هذا الموقع فقط لغرض الترويج لمنتجات ندى الأزهر والصادرة عن مؤسسة تسوق.كوم المتوفرة في المملكة العربية السعودية. بالنسبة لأولئك الذين يختارون الدخول إلى هذا الموقع من مواقع خارج المملكة العربية السعودية ، سيكونون مسؤولين عن الامتثال للقوانين المحلية إلى الحد الذي تكون فيه القوانين المحلية قابلة للتنفيذ والتنفيذ.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>6. حقوق الملكية:</strong></p>\r\n\r\n<p>&bull; محتوى الموقع محمي بموجب حقوق النشر والعلامات التجارية وقاعدة البيانات وحقوق الملكية الفكرية الأخرى. جميع الحقوق ، بما في ذلك حقوق النشر وحقوق الملكية الفكرية الأخرى ، في هذا الموقع مملوكة أو مرخصة من قبل مؤسسة تسوق.كوم للإلكترونيات.</p>\r\n\r\n<p>&bull; في حالة حصولك على أي حق أو حقوق ملكية فكرية أخرى على الموقع (سواء بموجب القانون أو غير ذلك) ، فإنك توافق على التنازل عن هذه الحقوق وتخصيصها (على أساس عالمي وإلى أقصى حد يسمح به القانون) لـ مؤسسة الأزهر ، بما في ذلك أي حقوق قد تكون لديك ، لديك محتوى من إنشاء المستخدم تقدمه من خلال الموقع. أنت أيضًا تتنازل دون قيد أو شرط عن تنازل غير قابل للنقض عن أي وجميع الحقوق المعنوية التي تحصل عليها أو الموقع.</p>\r\n\r\n<p>&bull; أنت توافق أيضًا على تنفيذ جميع هذه المستندات وكل هذه الإجراءات والأشياء وفقًا لما نطلبه بطريقة مناسبة من أجل التنازل عن هذه الحقوق لنا والتنازل عن أي حقوق معنوية تحصل عليها أو في الموقع.</p>\r\n\r\n<p><strong>7. الأمان وكلمة المرور والحساب:</strong> أنت مسؤول عن الحفاظ على خصوصية كلمة المرور الخاصة بك وأمان حسابك وأي أنشطة تحدث ضمن حسابك. نحن لسنا مسؤولين عن أي خسائر أو أضرار قد تحدث نتيجة أي فشل من جانبك في حماية كلمة المرور الخاصة بك وأمن حسابك.&nbsp;</p>\r\n\r\n<p><strong>8. توفر الموقع:</strong></p>\r\n\r\n<p>&bull; لا يمكننا أن نعد بأن الخدمات على الموقع ستكون خالية بشكل دائم من الأخطاء ، وفي حالة حدوث خطأ في الخدمة ، يرجى إبلاغ فريق خدمة العملاء لدينا على: info@ tswooq.com ، وسنحاول تصحيح الخطأ بأسرع ما يمكن.</p>\r\n\r\n<ul>\r\n	<li>قد يكون الوصول إلى الموقع مقيدًا أو مقيدًا في بعض الأحيان لتمكين الإصلاحات أو الترقيات أو الصيانة العامة. سنسعى لاستعادة الوصول في أقرب وقت ممكن.</li>\r\n</ul>\r\n\r\n<p><strong>9. تلف المعدات أو الأجهزة الأخرى:</strong></p>\r\n\r\n<p>&bull; تبذل مؤسسة تسوق.كوم الجهود المناسبة لضمان خلو هذا الموقع من الفيروسات والمحتويات الضارة الأخرى. بشكل عام ، نحن لا نضمن أن استخدامك لهذا الموقع (بما في ذلك أي محتوى عليه أو أي موقع يمكن الوصول إليه من خلاله) لن يسبب أي ضرر لجهاز الكمبيوتر الخاص بك أو الأجهزة الأخرى.</p>\r\n\r\n<p>&bull; ستكون مسؤولاً عن ضمان توافر المعدات والبرامج المناسبة (بما في ذلك برامج مكافحة الفيروسات) لاستخدام الموقع بأمان وأمان ولتصفية أي شيء قد يضر جهاز الكمبيوتر أو الأجهزة الأخرى. لن نكون مسؤولين تجاه أي شخص عن أي خسائر أو أضرار يتكبدها نتيجة للفيروسات أو غيرها من المحتويات الضارة التي تدخل من أو من خلال الموقع.</p>\r\n\r\n<p>&bull; قمنا بتوفير روابط وروابط لهذا الموقع من أجل الوصول إلى مواقع أخرى نعتقد أنك قد ترغب في زيارتها. نحن لا نفحص هذه المواقع ولا نتحكم في محتواها. نحن لا نتحمل أي مسؤولية فيما يتعلق باستخدام هذه المواقع. 10. دقة المحتوى: تتنازل شركة تسوق.كوم عن جميع التعهدات والضمانات ، سواء كانت صريحة أو ضمنية ، بأن المحتوى أو المعلومات المعروضة على هذا الموقع دقيقة أو كاملة أو محدثة و / أو أنها لا تنتهك حقوق أي طرف ثالث (إلى الحد الذي يسمح به القانون المعمول به).</p>\r\n\r\n<p>&bull; الآراء الواردة في المحتوى الذي ينتجه المستخدم هي آراء هؤلاء المستخدمين ولا تعبر بالضرورة عن آراء أو معتقدات أو قيم مؤسسة تسوق.كوم .</p>\r\n\r\n<p><strong>11- الإعلان والرعاية:</strong></p>\r\n\r\n<p>قد يحتوي الموقع على بعض الإعلانات ومحتوى الرعاية. هذه الإعلانات والرعاية مسؤولة عن المتابعة والتأكد من أن المواد المقدمة إلينا تتوافق مع القوانين ذات الصلة. لذلك ، لن نكون مسؤولين عن أي أخطاء أو عدم دقة في المواد الإعلانية والرعاية.</p>\r\n\r\n<p><strong>12. مسؤوليتنا:</strong></p>\r\n\r\n<p>&bull; يتم توفير الموقع من قبلنا لاستخدامك دون أي ضمانات. يجب أن تتحمل المسؤوليات المرتبطة باستخدام الإنترنت.</p>\r\n\r\n<p>&bull; لن نكون مسؤولين عن أي خرق لشروط هذه المواقع بسبب ظروف خارجة عن سيطرتنا.</p>\r\n\r\n<p>&bull; نتنازل عن جميع الضمانات والتعهدات والشروط والأحكام (سواء كانت صريحة أو ضمنية ، بموجب التشريع أو القانون العام أو غير ذلك) إلى أقصى حد يسمح به القانون. لن نتحمل أي مسؤولية عن أي خسائر أو أضرار غير متوقعة تنشأ عن أو مرتبطة بهذا الموقع أو استخدامك للموقع.</p>\r\n\r\n<p>&bull; باستثناء ما تقتضيه القوانين المعمول بها ، لن نكون مسؤولين تجاه أي شخص عن أي خسارة أو ضرر قد ينجم عن استخدام أو الاعتماد على أي محتوى أو معلومات معروضة على هذا الموقع.</p>\r\n\r\n<p>&bull; يجب ألا تحد شروط هذه المواقع أو تستبعد أي مسؤولية لا يحق لنا تقييدها أو استبعادها بموجب القانون المعمول به (مثل الوفاة أو الإصابة الشخصية).</p>\r\n\r\n<p><strong>13. الحماية:</strong></p>\r\n\r\n<p>ستكون مسؤولاً عن حمايتنا من جميع الخسائر والالتزامات والمصروفات التي نتحملها أو نتكبدها بشكل مناسب ، وجميع التعويضات التي تم منحها ضدنا بموجب أي حكم صادر عن أي محكمة قضائية وأي مبالغ مدفوعة من قبلنا نتيجة لأي تسوية متفق عليها. على. من جانبنا ناتج عن أو فيما يتعلق بـ: - أي ادعاء أو ادعاء من أي طرف ثالث بأن استخدامك للموقع تشهيري أو مسيء أو تنمر أو مسيء أو ذو طبيعة إباحية أو غير قانوني أو يشكل انتهاكًا لأي قانون أو لائحة أو مدونة لقواعد السلوك. أي ادعاء من قبل أي طرف ثالث بأن استخدامك لهذا الموقع ينتهك حقوق هذا الطرف الثالث. - حقوق النشر أو حقوق الملكية الفكرية الأخرى مهما كانت طبيعتها. - أي غرامات أو عقوبات تفرضها أي جهة تنظيمية ،</p>\r\n\r\n<p><strong>14. الشامل</strong></p>\r\n\r\n<p>الاتفاقية: شروط هذه المواقع (بما في ذلك سياساتنا المتعلقة بالخصوصية وسياسة ملفات تعريف الارتباط وشروط وأحكام البيع) تحدد وتوضح الاتفاقية الشاملة والكاملة بينك وبيننا وتحل محل أي وجميع الشروط والأحكام والضمانات و / أو التعهدات السابقة إلى أقصى حد يسمح به القانون.<br />\r\n<br />\r\n<strong>15. التغييرات في شروط وأحكام هذا الموقع:</strong>&nbsp;</p>\r\n\r\n<p>نحن نحتفظ بالحق في تغيير وتحديث شروط وأحكام هذا الموقع من وقت لآخر. نوصيك بزيارة هذه الصفحة بانتظام لإطلاعك على آخر التطورات في الشروط والأحكام وتحديثها. استمرار وصولك إلى هذا الموقع وتصفحه واستخدامه يعني موافقتك على أي تغييرات أو تحديثات لشروط وأحكام موقعنا.</p>\r\n\r\n<p><strong>16. شروط وأحكام التركيب:</strong><br />\r\n<br />\r\n&bull; يتم تسليم المنتج خلال 7 أيام عمل من تاريخ الشراء.</p>\r\n\r\n<p>&bull; لن يتم إجراء صيانة للمنتج<br />\r\n<br />\r\n<strong>17. شروط وأحكام مختلفة:</strong>&nbsp;</p>\r\n\r\n<p>&bull; في حالة عدم صلاحية أي من الشروط والأحكام الخاصة بهذا الموقع وفقًا لقرار من أي محكمة قضائية ، فإن بطلان هذا الشرط لن يؤثر على صلاحية باقي الشروط والأحكام الخاصة بهذا الموقع ، ويجب أن تظل بكامل فعاليتها وصلاحيتها وتأثيرها.&nbsp; &nbsp;<br />\r\n<br />\r\n&bull; هذا الموقع مملوك ومدار من قبل تسوق.كوم ، وهي مؤسسة مسجلة في المملكة العربية السعودية (رقم السجل التجاري 2250053429) ، وعنوانها الأحساء ، العمران ، شارع البلدية ، المملكة المملكة العربية السعودية.<br />\r\n<br />\r\n&bull; تسوق.كوم . جميع الحقوق في هذا الموقع محفوظة بالكامل. يتم منح الإذن لاستخدام هذا الموقع وفقًا لشروط الاستخدام. يشير مصطلح &quot;زهرة الندى&quot; إلى: &bull; جميع الأسعار المعروضة على موقع تسوق.كوم لا تشمل عملاء التقسيط الخاضعين لاتفاقية التقسيط المبرمة معنا والخاضعين لشروطهم وأحكامهم.</p>\r\n\r\n<p>&nbsp;</p>', 2, 3),
(7, 'About Us', '<h1>About Us</h1>\r\n\r\n<p>After years of success in providing high-quality products and services, Tswooq.com&ndash; with pride &ndash; its new stores and website, Tswooq.com, a comprehensive station for electronics, mobile devices and accessories, which provides international brands with excellence and quality at reasonable prices.</p>\r\n\r\n<p>The idea behind the brand identity, &ldquo;Tswooq.com&rdquo; is inspired by the huge and countless color waves and coral reefs that vary in shape and color. &ldquo;Tswooq.com&rdquo; is a strong partner, providing you with all the high-quality portable devices you need.<br />\r\nOur foundation is proud of its alliances with major companies such as: Apple, Samsung, Huawei, Xiaomi, Like Car and a large group of other international brands specialized in electronics, mobile devices, tablets and smart devices and another wide range of devices to meet your needs.</p>\r\n\r\n<p>Our organization designs, installs and operates technical solutions for the commercial mobile devices sector, as the institution has highly qualified technicians to provide solutions for a wide range of mobile devices, such as: tours, mobile devices, and other devices, and the institution provides an integrated set of services through its own expertise and strategic alliances with the largest technology companies in the field of mobile devices around the world,<br />\r\nwhere we have a partnership relationships with the giants of mobile devices in the world such as Apple, Samsung, and Huawei, which enabled the organization to offer technical services regarding the maintenance of mobile devices, which are not comparable in quality against the price.</p>\r\n\r\n<p>The company owns the trademark rights of the institution, which seeks to provide a variety of products from mobile devices that are manufactured using the latest technologies, as they are spread all over the world, whether in Europe, Asia, North America or Africa, as these products are designed to suit all members of society.</p>\r\n\r\n<p>Tswooq.com has a proven track record of success in terms of quality and product longevity. The commercial field includes a large chain of retail trade that includes all parts of the Kingdom, where the sales outlets are designed to support the consumer experience by providing a wide range of products at incomparable prices, taking into account the after-sales services.</p>\r\n\r\n<p>The Corporation has a network of services that it seeks to spread throughout the Kingdom, supported by a strong team of engineers and technicians.</p>\r\n\r\n<p>The corporation has a strong presence in the field of mobile devices and maintenance services, as the distribution network covers traditional agents and sales channels for large markets, and the company has more than 100 allies in the Kingdom, including agents and a huge market network that sells a wide range of products.</p>\r\n\r\n<p>The company prides itself on obtaining the trust and loyalty of the ultimate consumer, and the organization seeks to retain its customers for many years to come through the level of sales and after-sales services.</p>', 1, 4),
(8, 'نبذه عنا', '<h1>معلومات عنا</h1>\r\n\r\n<p>بعد سنوات من النجاح في تقديم منتجات وخدمات عالية الجودة ، أطلقت شركة تسوق.كوم - بكل فخر - متاجرها الجديدة وموقعها الإلكتروني ،تسوق.كوم، محطة شاملة للإلكترونيات والأجهزة المحمولة وملحقاتها ، والتي توفر العلامات التجارية العالمية بامتياز و الجودة بأسعار معقولة.</p>\r\n\r\n<p>الفكرة وراء هوية العلامة التجارية &quot;تسوق.كوم&quot; مستوحاة من موجات الألوان الضخمة التي لا حصر لها والشعاب المرجانية التي تتنوع في الشكل واللون. تسوق.كوم شريك قوي ، يوفر لك جميع الأجهزة المحمولة عالية الجودة التي تحتاجها.<br />\r\nتفتخر مؤسستنا بتحالفاتها مع كبرى الشركات مثل: Apple و Samsung و Huawei و Xiaomi و Like Car ومجموعة كبيرة من العلامات التجارية العالمية الأخرى المتخصصة في الإلكترونيات والأجهزة المحمولة والأجهزة اللوحية والأجهزة الذكية ومجموعة واسعة أخرى من الأجهزة لتلبية احتياجاتك.</p>\r\n\r\n<p>تقوم مؤسستنا بتصميم وتركيب وتشغيل الحلول التقنية لقطاع الأجهزة المحمولة التجارية ، حيث تمتلك المؤسسة فنيين مؤهلين تأهيلاً عالياً لتقديم حلول لمجموعة واسعة من الأجهزة المحمولة ، مثل: الجولات ، والأجهزة المحمولة ، والأجهزة الأخرى ، وتوفر المؤسسة مجموعة متكاملة من الخدمات من خلال خبرتها الخاصة وتحالفاتها الإستراتيجية مع أكبر شركات التكنولوجيا في مجال الأجهزة المحمولة حول العالم ،<br />\r\nحيث لدينا علاقات شراكة مع عمالقة الأجهزة المحمولة في العالم مثل Apple و Samsung و Huawei والتي مكنت المؤسسة من تقديم خدمات فنية تتعلق بصيانة الأجهزة المحمولة والتي لا تضاهي الجودة مقابل السعر.</p>\r\n\r\n<p>تمتلك الشركة حقوق العلامة التجارية للمؤسسة التي تسعى لتوفير مجموعة متنوعة من المنتجات من الأجهزة المحمولة التي يتم تصنيعها باستخدام أحدث التقنيات ، حيث أنها منتشرة في جميع أنحاء العالم سواء في أوروبا أو آسيا أو أمريكا الشمالية أو أفريقيا ، مثل تم تصميم هذه المنتجات لتناسب جميع أفراد المجتمع.</p>\r\n\r\n<p>تسوق.كوم لديها سجل حافل من النجاحات من حيث الجودة وطول عمر المنتج. يشمل المجال التجاري سلسلة كبيرة من تجارة التجزئة تشمل جميع أنحاء المملكة ، حيث تم تصميم منافذ البيع لدعم تجربة المستهلك من خلال توفير مجموعة واسعة من المنتجات بأسعار لا تضاهى ، مع مراعاة خدمات ما بعد البيع.</p>\r\n\r\n<p>تمتلك المؤسسة شبكة من الخدمات التي تسعى إلى نشرها في جميع أنحاء المملكة ، مدعومة بفريق قوي من المهندسين والفنيين.</p>\r\n\r\n<p>للمؤسسة حضور قوي في مجال الأجهزة المحمولة وخدمات الصيانة ، حيث تغطي شبكة التوزيع الوكلاء التقليديين وقنوات البيع للأسواق الكبيرة ، ولدى الشركة أكثر من 100 حلفاء في المملكة من بينهم وكلاء وشبكة سوق ضخمة تبيع مجموعة واسعة من المنتجات.</p>\r\n\r\n<p>تفتخر الشركة بحصولها على ثقة وولاء المستهلك النهائي ، وتسعى المنظمة للاحتفاظ بعملائها لسنوات عديدة قادمة من خلال مستوى المبيعات وخدمات ما بعد البيع</p>', 2, 4);
