(34, 17, 2, 'سوني  بلاي ستيشن 5', '<p>لميزات الأساسية</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>يمكنك تجربة التحميل بسرعة الضوء مع محرك الأقراص SSD فائق السرعة، واتصال أعمق بالدعم</li>\r\n	<li>يمكنك الاستفادة من قوة وحدة المعالجة المركزية ووحدة معالجة الرسومات ومحرك الأقراص SSD المخصصة بفضل وحدات الإدخال والإخراج المدمجة</li>\r\n	<li>يتوافق جهاز الألعاب بلايستيشن 5 مع أجهزة العرض بدقة 8K عن طريق منفذ HDMI 2.1</li>\r\n	<li>عند توافر تلفزيون بتقنية النطاق الديناميكي العالي، فستعرض ألعاب جهاز الألعاب بلايستيشن 5 المدعومة مجموعة ألوان حيوية وواقعية</li>\r\n</ul>\r\n\r\n<p>المواصفات</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>اسم اللون</td>\r\n			<td>أبيض</td>\r\n		</tr>\r\n		<tr>\r\n			<td>الدرجة</td>\r\n			<td>جديد</td>\r\n		</tr>\r\n		<tr>\r\n			<td>اسم الموديل</td>\r\n			<td>PS5</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>رقم الموديل</td>\r\n			<td>PS5</td>\r\n		</tr>\r\n		<tr>\r\n			<td>نوع برنامج جهاز الألعاب</td>\r\n			<td>PlayStation 5 (PS5)</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
