(159, 80, 1, 'Honor 8A', '<p>Processor: Medatec Helio P35 octa-core processor<br />\r\nStorage / RAM: 32/64 GB, 2/3 GB RAM<br />\r\nCamera: 13 MB back. Front 8 MB<br />\r\nScreen: 6 inches with a small HD + notch<br />\r\nOperating System: Android 9.0<br />\r\nBattery: 3020 mAh</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL);
