(164, 82, 2, 'احزمة رجالي', '<p><br />\r\nالمواصفات:&nbsp;<br />\r\n* الخامة جلد ذات جودة عالية.&nbsp;<br />\r\n* تصميم أنيق وعصري.&nbsp;<br />\r\n* حليه معدن لون ثابت .&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
