(166, 83, 2, 'سامسونج جلاكسي  A10s', '<ul>\r\n	<li>\r\n	<p><strong>المعالج</strong>:&nbsp;Mediatek Helio P22 ثماني النواة تكنولوجيا 12 نانو</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>التخزين / الرام</strong>:&nbsp;32 جيجا مع 2 جيجا رام</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>الكاميرا</strong>:&nbsp;خلفية ثنائية 13+2 م.ب. / امامية 8 م.ب.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>الشاشة</strong>:&nbsp;شاشة 6.2 بوصة بدقة HD+ بها نوتش صغير</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>نظام التشغيل</strong>:&nbsp;اندرويد 9.0</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>البطارية</strong>:&nbsp;4000 مللي أمبير</p>\r\n	</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(167, 84, 1, 'Samsung Galaxy A51', '<p>Processor: Exynos 9611 Octa core 10 nano technology<br />\r\nStorage / RAM: 128 GB with 6/8 GB RAM<br />\r\nCamera: Quad rear 48 + 12 + 5 + 5 MB. Front 32 MB<br />\r\nScreen: 6.5-inch FHD + screen with a small hole<br />\r\nOperating system: Android 10<br />\r\nBattery: 4000 mAh</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(168, 84, 2, 'سامسونج جلاكسي A51', '<p>المعالج: Exynos 9611 ثماني النواة تكنولوجيا 10 نانو<br />\r\nالتخزين / الرام: 128 جيجا مع 6/8 جيجا رام<br />\r\nالكاميرا: خلفية رباعية 48+12+5+5 م.ب. / امامية 32 م.ب.<br />\r\nالشاشة: شاشة 6.5 بوصة بدقة FHD+ بها ثقب صغير<br />\r\nنظام التشغيل: اندرويد 10<br />\r\nالبطارية: 4000 مللي أمبير</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(169, 85, 1, 'Cover iphone', '<pre>\r\nSpecifications:\r\n* Back half transparent cover\r\n* Shock resistant\r\n* Equipped with a holder for easy mobile portability\r\n* Suitable for iPhone 7-8-9-10 models</pre>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(170, 85, 2, 'غلاف ايفون', '<p><br />\r\nالمواصفات:&nbsp;<br />\r\n*غلاف خلفي نصف شفاف&nbsp;<br />\r\n* مقاوم للصدمات&nbsp;<br />\r\n* مزود بماسك لسهولة حمل الموبايل&nbsp;<br />\r\n* مناسب لموديلات ايفون 7- 8 - 9 - 10&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(171, 86, 1, 'Iphone charger original', '<pre>\r\nSpecifications:\r\n * Apple wall charger 20W USB-C\r\n* Provides fast and efficient charging\r\n* Compatible with any USB-enabled device</pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<pre>\r\n\r\n&nbsp;</pre>\r\n\r\n<p><img alt=\\\"رمز &quot;تم التحقق منها بواسطة المنتدى&quot;\\\" src=\\\"data:image/png;base64,\\\" style=\\\"height:16px; width:16px\\\" /></p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(172, 86, 2, 'رأس شاحن ايفون أصلي', '<p><br />\r\nالمواصفات:&nbsp;<br />\r\n&nbsp;* شاحن حائطي من ابل 20 وات يو اس بي سي&nbsp;<br />\r\n* يوفر شحنًا سريعًا وفعالًا&nbsp;<br />\r\n* متوافق مع أي جهاز يدعم يو اس بي&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(175, 88, 1, 'Glasses', '<pre>\r\nSpecifications:\r\n* High quality glass and frame.\r\n* Stylish and modern design\r\n* Various shapes and styles are available.</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(176, 88, 2, 'نظارات', '<p><br />\r\nالمواصفات :&nbsp;<br />\r\n* جودة عالية في خامة الزجاج وإطار النظارة .<br />\r\n* تصميم أنيق وعصري&nbsp;<br />\r\n* متوفر أشكال وموديلات عديدة.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(177, 89, 1, 'Huawei Nova 7i', '<p>Processor: HiSilicon Kirin 810, eight core, 7 nano technology</p>\r\n\r\n<p>Ram / size: 128 GB with 8 GB RAM</p>\r\n\r\n<p>Camera: Quad rear 48 + 8 + 2 + 2 MB. Front / 16 MB.</p>\r\n\r\n<p>Screen: 6.4 inches, FHD + resolution, has a small hole</p>\r\n\r\n<p>Operating system: Android 10.0</p>\r\n\r\n<p>Battery: 4,200 mAh</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(178, 89, 2, 'هواوي نوفا 7 i', '<ul>\r\n	<li>\r\n	<p><strong>المعالج</strong>:&nbsp;ثماني النواة HiSilicon Kirin 810 تكنولوجيا 7 نانو</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>التخزين / الرام</strong>:&nbsp;128 جيجا مع 8 جيجا رام</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>الكاميرا</strong>:&nbsp;خلفية رباعية 48+8+2+2 م.ب. / امامية 16 م.ب.</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>الشاشة</strong>:&nbsp;6.4 بوصة بدقة FHD+ بها ثقب صغير</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>نظام التشغيل</strong>:&nbsp;اندرويد 10.0</p>\r\n	</li>\r\n	<li>\r\n	<p><strong>البطارية</strong>:&nbsp;4200 مللي أمبير</p>\r\n	</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(179, 90, 1, 'Apple Watch Series 5, 40mm, GPS', '<p>Main features<br />\r\nGPS<br />\r\nRetina screen never turns off<br />\r\n30% larger screen<br />\r\nWater resistant to a depth of 50 meters<br />\r\nOptical and electrical heart rate sensors<br />\r\nStore music, podcast episodes, and audiobooks<br />\r\nCompass and altimeter<br />\r\nSOS Emergency<br />\r\nFall detection feature<br />\r\nS5 SiP chip with dual-core 64-bit processor up to 2x faster<br />\r\nWatchOS 6 with features including activity levels, menstrual tracking, loud noise notifications, and the App Store on your wrist<br />\r\nGolding Aluminum frame</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(180, 90, 2, 'أبل ساعة الاصدار 5، مقاس 40 ملم، جي بي اس', '<h2>الميزات الرئيسية</h2>\r\n\r\n<ul>\r\n	<li>GPS</li>\r\n	<li>شاشة Retina لا تنطفئ</li>\r\n	<li>شاشة أكبر بنسبة 30%</li>\r\n	<li>مقاومة للماء لغاية عمق 50 متراً</li>\r\n	<li>مستشعرات بصرية وكهربائية لنبض القلب</li>\r\n	<li>تخزين الموسيقى وحلقات البودكاست والكتب الصوتية</li>\r\n	<li>بوصلة وميزة تحديد الارتفاع</li>\r\n	<li>طوارئ SOS</li>\r\n	<li>ميزة اكتشاف السقوط</li>\r\n	<li>شريحة S5 بنظام دوائر متكاملة مجمعة (SiP) مع معالج ثنائي النواة ببنية 64-bit لغاية 2x أسرع</li>\r\n	<li>نظام watchOS&nbsp;6 مع ميزات تشمل مستويات النشاط وتتبّع الدورة الشهرية وإشعارات الضوضاء العالية وApp&nbsp;Store على معصمك</li>\r\n	<li>إطار ألومنيوم ذهبي</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(181, 91, 1, 'Apple Watch Series 6 size 44', '<p>Main features</p>\r\n\r\n<ul>\r\n	<li>The GPS model allows you to receive calls and respond to text messages from your wrist</li>\r\n	<li>Measurement of blood oxygen level with the help of a completely new sensor and application</li>\r\n	<li>Check your heart rate anytime with the heart rate app</li>\r\n	<li>Get notifications for high and low heart rate</li>\r\n	<li>The Never-Off Retina display is 2.5 times brighter outside when your wrist is not raised</li>\r\n	<li>The S6 SiP chip is up to 20% faster than Series 5</li>\r\n	<li>5GHz Wi-Fi, Ultra Wide U1</li>\r\n	<li>The ability to track your daily activity on Apple Watch and see performance levels on the iPhone fitness app</li>\r\n	<li>Measure exercise such as running, walking, cycling, yoga, swimming, and dancing</li>\r\n	<li>Waterproof design</li>\r\n	<li>Sync your favorite music and podcast episodes</li>\r\n	<li>Built-in compass and real-time altitude</li>\r\n	<li>You can detect a hard fall, and then automatically call emergency services to help you</li>\r\n	<li>The Emergency SOS feature enables you to request assistance from your wrist</li>\r\n	<li>WatchOS 7 with sleep tracking and new customizable watch faces</li>\r\n	<li>Aluminum frames with new colors</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(182, 91, 2, 'ساعة ابل الاصدار ٦ مقاس ٤٤', '<h2>الميزات الرئيسية</h2>\r\n\r\n<ul>\r\n	<li>يتيح لك موديل GPS استقبال المكالمات والرد على الرسائل النصية من معصمك</li>\r\n	<li>قياس مستوى أكسجين الدم بمساعدة مستشعر وتطبيق جديدين تماماً</li>\r\n	<li>التحقق من معدل نبض قلبك في أي وقت مع تطبيق معدل نبض القلب</li>\r\n	<li>الحصول على إشعارات ارتفاع معدل نبض القلب وانخفاضه</li>\r\n	<li>شاشة Retina التي لا تنطفئ أكثر سطوعاً في الخارج بمرتين ونصف المرة عندما لا يكون معصمك مرفوعاً</li>\r\n	<li>شريحة S6 بنظام دوائر متكاملة مجمعة (SiP) سرعتها أكبر بما يصل إلى 20% من Series&nbsp;5</li>\r\n	<li>شبكة Wi-Fi بنطاق 5GHz وشريحة U1 بنطاق فائق العرض</li>\r\n	<li>إمكانية تتبع نشاطك اليومي على Apple&nbsp;Watch ومعرفة مستويات الأداء على تطبيق اللياقة في iPhone</li>\r\n	<li>قياس التمارين الرياضية كالركض، والمشي، وركوب الدراجة، واليوغا، والسباحة، والرقص</li>\r\n	<li>تصميم مقاوم للماء</li>\r\n	<li>مزامنة ما تفضله من الموسيقى وحلقات البودكاست</li>\r\n	<li>البوصلة المدمجة وميزة تحديد الارتفاع في الوقت الفعلي</li>\r\n	<li>تستطيع أن تكتشف تعرضك لسقوط قوي ثم الاتصال تلقائياً بخدمات الطوارئ لإسعافك</li>\r\n	<li>ميزة طوارئ SOS تمكنك من طلب المساعدة من معصمك</li>\r\n	<li>نظام watchOS&nbsp;7 بخاصية تتبّع أنماط النوم وواجهات الساعة الجديدة القابلة للتخصيص</li>\r\n	<li>إطارات مصنوعة من الألومنيوم بألوان جديدة</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(183, 92, 1, 'SanDisk - microSD memory card', '<p>Capacity: 16-32-64-128 GB<br />\r\nCompatible with: smartphones, laptops, tablets, and other devices</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(184, 92, 2, 'سان ديسك - كارت ذاكرة ميكرو', '<p><strong>السعة: 16-32-64-128&nbsp;</strong>جيجا بايت<br />\r\n<strong>متوافق مع:&nbsp;</strong>الهواتف الذكية وأجهزة الكمبيوتر المحمولة والأجهزة اللوحية وغيرها من الأجهزة</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(185, 93, 1, 'SanDisk - USB Flash Drive', '<p>Capacity: 8-16-32-64-128 GB<br />\r\nConnectivity: USB 2.0<br />\r\nCompatible with: Win OS / MAC OS</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(186, 93, 2, 'فلاش ميموري', '<p><strong>السعه:8-16-32-64-128&nbsp;</strong>جيجا بايت<br />\r\n<strong>الاتصال:</strong>&nbsp;USB 2.0<br />\r\n<strong>متوافق مع:</strong>&nbsp;Win OS /MAC OS</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(187, 94, 1, 'WUW Bluetooth R32 headphones', '<p>R32 HEADPHONES FOR LIGHTNING FROM WUW.<br />\r\nIn contrast to the rounded shape of the traditional lines of the headphone, the design of the new headphones is imposed by the geometry of the ear. This is why for many users it will be more comfortable than any other earbuds.<br />\r\nThe lightning earbuds are equipped with a built-in remote control that can adjust the volume,<br />\r\nAnd control music, play videos, and receive or complete calls at the touch of a tap.<br />\r\nTo connect headphones, you need to put them in the Lightning connector and connect them<br />\r\nBluetooth.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(188, 94, 2, 'سماعات الأذن بتقنية Bluetooth R32من WUW', '<p>سماعات رأس R32 لLIGHTNING من WUW.<br />\r\nعلى عكس الشكل المستدير للخطوط التقليدية لسماعة الرأس، يتم فرض تصميم سماعات الرأس الجديدة من خلال هندسة الأذن. هذا هو السبب في أنها ستكون أكثر راحة بالنسبة للعديد من المستخدمين من أي سماعات الأذن الأخرى.<br />\r\nتم تجهيز سماعات الأذن البرق مع جهاز التحكم عن بعد المدمج في التي يمكن ضبط مستوى الصوت،<br />\r\nوالتحكم في الموسيقى وتشغيل الفيديو، وتلقي أو إكمال المكالمات في لمسة من الصنبور.<br />\r\nلتوصيل سماعات الرأس، تحتاج إلى وضعها في موصل Lightning وتوصيلها<br />\r\nبلوتوث.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(189, 95, 1, 'Redmi AirDots', '<p>Comes with the Bluetooth 5.0 version with the RTL8763BFR chip, which allows the headphone to connect to the phone immediately after leaving the charging case.</p>\r\n\r\n<p>● Dynamic thickness up to 7.2mm.</p>\r\n\r\n<p>● Touch control to play music and operate the voice assistant (Siri / Google Assisstant).</p>\r\n\r\n<p>Dimensions: 26.65 x 16.4 x 21.6mm; Weight: 4.1 grams (for one headphone only).</p>\r\n\r\n<p>● Charging case dimensions: 62 x 40 x 27.2mm; Weight: 35.4g.</p>\r\n\r\n<p>● 40mAh battery in the headphones provides 4 hours battery life on a single charge,</p>\r\n\r\n<p>The charging case comes with a battery with a capacity of 300mAh, enough to charge the watch for another 12 hours.</p>\r\n\r\n<p>● Water splash resistant.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(190, 95, 2, 'ريدمي أيردوتس', '<p>تأتي مع إصدار Bluetooth 5.0 مع شريحة RTL8763BFR والتي تسمح للسماعة أن تتصل بالهاتف فوراً بعد خروجها من علبة الشحن.<br />\r\n● سمك دينامميكي يصل الى 7.2mm.<br />\r\n● التحكم باللمس لتشغيل الموسيقى وتشغيل المساعد الصوت (Siri / Google Assisstant).<br />\r\n● الأبعاد : 26.65 &times; 16.4 &times; 21.6 مم ؛ الوزن: 4.1 جرام (للسماعة الواحدة فقط).<br />\r\n● أبعاد علبة الشحن: 62 &times; 40 &times; 27.2 مم ؛ الوزن: 35.4 جرام.<br />\r\n● بطارية بسعة 40mAh في سماعات الرأس توفر عمر بطارية 4 ساعات لشحنة واحدة ،<br />\r\nوتأتي علبة الشحن ببطارية بسعة 300mAh تكفي لشحت المساعة 12 ساعة أخرى.<br />\r\n● مقاومة لرذاذ المياه.</p>\r\n\r\n<p>● تأتي مع امكانية الغاء الضوضاء اثناء المكالمات فقط.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(193, 97, 1, 'Huawei pro 2 4g', '<pre>\r\n&bull; Ensures optimum coverage and maximum signal strength even in large multi-storey buildings\r\n&bull; Enhances data processing with super speed\r\nIt provides a download speed of 300 Mbps</pre>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
