(206, 103, 2, 'وصله نوع ايفون', '<p>&nbsp; مميزاتة :<br />\r\nيدعم خاصية الشحن السريع<br />\r\n&bull;تصل سرعة الشحن إلى 100 وات<br />\r\n&bull;سرعة نقل البيانات تصل إلى 480 ميجابايت في الثانية.<br />\r\n&bull;مصنوع من نايلون مضفر&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(207, 104, 1, 'Apple Air Pods Pro', '<p>* Excellent sound / noise isolation<br />\r\n* Sound is clear, especially when noise isolation is activated<br />\r\n* Resistant to water splashes and perspiration<br />\r\n* Great integration with iPhone 11 phones</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(208, 104, 2, 'ابل اير بودز برو', '<p>* عزل صوت / ضوضاء ممتاز<br />\r\n* صوت نقي خاصةً عند تفعيل عزل الضوضاء<br />\r\n* مقاومة لرذاذ المياه والتعرق<br />\r\n* تكامل كبير مع هواتف آيفون 11</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(209, 105, 1, 'ْXiaomi mi band 5', '<p>* AMOLED color screen<br />\r\n* More than 100 new animated screen faces inspired by the characters of the most popular cartoon series<br />\r\n* More than 11 sports tracking modes, including rowing, skipping rope, and yoga.<br />\r\n* Supporting water resistance to a depth of 50 meters, which makes it suitable for wearing while swimming or showering.<br />\r\n* Track sleep quality 24 hours.<br />\r\n* Track your heart rate throughout the day.<br />\r\n* Alert the user with vibrations when the heart rate increases.<br />\r\n* Measurement of the rate of stress or tension.<br />\r\n* Support for controlling smart home devices such as smart bulbs, cleaning robots, and others.<br />\r\n* Battery needs to be charged every 14 days, and it can last for 20 days, depending on use</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(210, 105, 2, 'ساعة ذكية شاومي باند 5', '<p>&nbsp;شاشة AMOLED ملونة&nbsp;<br />\r\n* أكثر من 100 وجه جديد متحرك للشاشة مستوحي من شخصيات أشهر مسلسلات الرسوم المتحركة<br />\r\n* &nbsp;أكثر من 11 وضع رياضي للتتبع، بما في ذلك التجديف وتخطي الحبل واليوجا.&nbsp;<br />\r\n* دعم مقاومة الماء حتى عمق 50 مترا، وهو ما يجعلها مناسبة للارتداء في أثناء السباحة أو الاستحمام.&nbsp;<br />\r\n* تتبع جودة النوم على مدار 24 ساعة.&nbsp;<br />\r\n* تتبع معدل ضربات القلب على مدار اليوم.&nbsp;<br />\r\n* تنبيه المستخدم بالاهتزازات عند ارتفاع معدل نبضات القلب.&nbsp;<br />\r\n* قياس معدل الإجهاد أو التوتر.&nbsp;<br />\r\n* دعم التحكم في أجهزة المنزل الذكية مثل اللمبات الذكية وروبوتات التنظيف وغيرها.&nbsp;<br />\r\n* بطارية تحتاج للشحن كل 14 يوم، ويمكنها الاستمرار لمدة 20 يوما حسب الاستخدام</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(211, 106, 1, 'Xiaomi Camera', '<p>* Wonderful and fashionable Xiaomi design.<br />\r\n* Wide shooting angle of 110 degrees and 360 degrees rotation.<br />\r\n* It works on WiFi and USB charger cord.<br />\r\n* Full HD 1080p shooting.<br />\r\n* Supports night photography automatically when dark.<br />\r\n* Support external memory up to 64 GB.<br />\r\n* Talk and listen feature on both sides between the mobile and the camera.<br />\r\n* The motion detector (at a distance of 10 m) that automatically sends you an alert on the application that there is a movement in front of the camera and can control its sensitivity and the time to activate this feature.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(212, 106, 2, 'شاومي كاميرا مراقبة', '<p>* تصميم رائع وعصري من شاومي.<br />\r\n* زاوية تصوير عريضة 110 درجة ودوران بزاوية 360 درجة.<br />\r\n* تعمل على WiFi وسلك شاحن USB.<br />\r\n* تصوير فل اتش دي بدقة 1080 HD.<br />\r\n* تدعم التصوير الليلي تلقائياً عند الظلام.<br />\r\n* دعم ذاكرة خارجية حتى 64 جيجا.<br />\r\n* خاصية التحدث والإستماع من الجهتين بين الجوال والكاميرا.<br />\r\n* كاشف الحركة (على مسافة 10م) الذي يرسل لك تنبيه تلقائياً على التطبيق بوجود حركة امام الكاميرا ويمكن التحكم في مدى حساسيته وزمن تفعيل هذه الخاصية.&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(213, 107, 1, 'Mi Box s Xiaomi 4K', '<p>* Compatible with thousands of applications<br />\r\n* It features the latest 4k HDR technology<br />\r\n* With Dolby and DTS, you can enjoy 3D stereo sound<br />\r\n* High performance and large storage capacity<br />\r\n* Supports Wi-Fi, Bluetooth, USB, HDMI connection</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(214, 107, 2, 'شاومي box s 4K', '<p>* متوافق مع آلاف من التطبيقات&nbsp;<br />\r\n* يتميز بأحدث تقنية 4k HDR&nbsp;<br />\r\n* عبر تقنية Dolby و DTS يمكنك الاستمتاع بصوت مجسم ثلاثي الأبعاد<br />\r\n* أداء عالي وسعة تخزين كبيرة&nbsp;<br />\r\n* يدعم اتصال Wi-Fi و Bluetooth و USB ، HDMI&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(215, 108, 1, 'Oppo A31', '<p>* Processor: Mediatek Helio P35 octa-core, 12 nano technology<br />\r\n* Storage / RAM: 128 GB with 4 GB RAM<br />\r\n* Camera: Triple rear 12 + 2 + 2 MB. Front 8 MB<br />\r\n* Screen: 6.5 inches HD + with a small notch<br />\r\nOperating system: Android 9.0<br />\r\nBattery: 4230 mAh</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(216, 108, 2, 'اوبو A31', '<p>* المعالج: Mediatek Helio P35 ثماني النواة تكنولوجيا 12 نانو<br />\r\n* التخزين / الرام: 128 جيجا مع 4 جيجا رام<br />\r\n* الكاميرا: خلفية ثلاثية 12+2+2 م.ب. / امامية 8 م.ب.<br />\r\n* الشاشة: 6.5 بوصة بدقة HD+ بها نوتش صغير<br />\r\n* نظام التشغيل: اندرويد 9.0<br />\r\n* البطارية: 4230 مللي أمبير</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(217, 109, 1, 'Oppo A92', '<p>* Processor: Snapdragon 665 octa-core, 11 nano technology<br />\r\n* Storage / RAM: 128 GB with 8 GB RAM<br />\r\n* Camera: Quad rear 48 + 8 + 2 + 2 MB. Front / 16 MB.<br />\r\n* Screen: 6.5 inches, FHD + resolution, has a small hole<br />\r\nOperating system: Android 10.0<br />\r\nBattery: 5000 mAh</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
