(220, 110, 2, 'اوبو A12', '<p>* المعالج: Mediatek Helio P35 ثماني النواة تكنولوجيا 12 نانو<br />\r\n* التخزين / الرام: 32 جيجا مع 3 جيجا رام<br />\r\n* الكاميرا: خلفية ثنائية 13+2 م.ب. / امامية 5 م.ب.<br />\r\n* الشاشة: 6.22 بوصة بدقة HD+ بها نوتش صغير<br />\r\n* نظام التشغيل: اندرويد 9.0<br />\r\n* البطارية: 4230 مللي أمبير</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(221, 111, 1, 'Huawei Prime Router 5g', '<pre>\r\nThe maximum data rate can be up to 4.6 Gb / s, which is much faster than current 4G speeds. The new 5G device supports sixth-generation Wi-Fi networks (Ax), where the data speed within the network reaches 4.8 Gb / s. Because of this, a 1GB file can be downloaded in just 3 seconds, that is, instantly. The maximum data rate is 4.6 Gbit / s, which is much faster than current 4G speeds. The new 5G device supports sixth-generation Wi-Fi networks (Ax), where the data speed within the network reaches 4.8 Gb / s. Because of this, a 1GB file can be downloaded in just 3 seconds, that is, instantly.</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(222, 111, 2, 'راوتر هواوي برايم 5g', '<p>يمكن أن يصل الحد الأقصى لمعدل البيانات إلى 4.6 جيجابت / ثانية ، وهو أسرع جدًا من سرعات 4G الحالية. يدعم جهاز 5G الجديد شبكات Wi-Fi من الجيل السادس (الفأس) ، حيث تصل سرعة تبادل البيانات داخل الشبكة إلى 4.8 جيجابت / ثانية. لهذا السبب ، يمكن تنزيل ملف بسعة 1 جيجا في 3 ثوانٍ فقط ، أي على الفور تقريبًا.&nbsp;أن يصل الحد الأقصى لمعدل البيانات إلى 4.6 جيجابت / ثانية ، وهو أسرع جدًا من سرعات 4G الحالية. يدعم جهاز 5G الجديد شبكات Wi-Fi من الجيل السادس (الفأس) ، حيث تصل سرعة تبادل البيانات داخل الشبكة إلى 4.8 جيجابت / ثانية. لهذا السبب ، يمكن تنزيل ملف بسعة 1 جيجا في 3 ثوانٍ فقط ، أي على الفور تقريبًا.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
