(225, 113, 1, 'Huawei B315S Pro Wireless Router,', '<p>Supports all 4G LTE networks<br />\r\nUltra-fast, 150Mbps download speed<br />\r\nCAT 4 Imaging Technology Strong 250 meters Wi-Fi<br />\r\nWarranty for up to 32 wireless users<br />\r\n2 external network amplifiers<br />\r\nUSB 2.0 port to access the printer or drives<br />\r\nUser-friendly design of LED indicator<br />\r\nEasy to set up and install<br />\r\nVoice SMS Calendar<br />\r\nProtected secure connection<br />\r\nConvenient for small enterprises to set up a private network<br />\r\nBlack color</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(226, 113, 2, 'هواوي B315S برو رواتر لاسلكي', '<ul>\r\n	<li>يدعم جميع الشبكات 4G LTE</li>\r\n	<li>فائقة السرعة ، بسرعة تحميل 150 ميغابت في الثانية</li>\r\n	<li>تقنية CAT 4 لتغطية شبكة Wi-Fi قوية تبلغ 250 مترًا</li>\r\n	<li>تدعم لغاية 32 مستخدمًا لاسلكيًا</li>\r\n	<li>2 مقويات شبكة خارجية</li>\r\n	<li>منفذ USB 2.0 للوصول لطابعة او اقراص التخزين</li>\r\n	<li>تصميم سهل الاستخدام من مؤشر LED</li>\r\n	<li>سهل الاعداد والتركيب</li>\r\n	<li>صوت وخدمة الرسائل القصيرة المعتمدة</li>\r\n	<li>اتصال آمن محمي</li>\r\n	<li>مريحة للمؤسسات الصغيرة لإعداد شبكة خاصة</li>\r\n	<li>لون أسود</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(227, 114, 1, 'Airpods pro', '<p>Type: wireless<br />\r\nConnectivity: Bluetooth 5.0<br />\r\nCompatible with: iPhone, iPad, iPod, Apple Watch models, Apple TV models, Mac models<br />\r\nthe color is white</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
