(229, 115, 1, 'Wopow power bank', '', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(230, 115, 2, 'وبو - باور بانك', '<p>بطارية متنقلة بسعة 6700 امبير</p>\r\n\r\n<ul>\r\n	<li>صغير جدا وسهولة بالتنقل</li>\r\n	<li>مزود بتقنية باور بوست لشحن جهازك بجودة وامان</li>\r\n	<li>خاصية IQ</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(231, 116, 1, 'Iphone cable', '<pre>\r\nIPhone cable with smart PD technology\r\n\r\n Type of cable (Type C input - iPhone output)\r\n\r\nSupports fast and safe charging\r\n\r\nHigh quality</pre>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(232, 116, 2, 'كيبل ايفون', '<p>كيبل ايفون بتقنية PD الذكية</p>\r\n\r\n<p>&nbsp;نوع الكيبل ( مدخل تايب سي - مخرج ايفون )</p>\r\n\r\n<p>يدعم الشحن السريع وآمن&nbsp;</p>\r\n\r\n<p>جودة عالية</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(233, 117, 1, 'Sony PlayStation 5 Camera HD', '<ul>\r\n	<li>Share with your friends your gaming experience with the upgraded PlayStation 5 Camera, your broadcast photos and HD videos, seamlessly and with clarity.</li>\r\n	<li>Get the perfect shot with the built-in adjustable stand for the HD Camera. Its compact design also allows it to be placed securely above or below TVs, so you can adjust the angle to suit your setup.</li>\r\n	<li>Enjoy great productions with the PlayStation 5&#39;s built-in background removal tools (ability to trim or remove background completely with green screen)</li>\r\n	<li>Capture yourself with precision, clarity and in Full HD quality with the dual wide-angle camera lenses while enjoying the epic gaming moments. Quickly start recording or broadcasting for yourself and your gaming experience with the DualSense Wireless Create Button</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(234, 117, 2, 'كاميرا HD بلاي ستيشن 5', '<ul>\r\n	<li>شارك مع أصدقائك تجربة لعبك مع كاميرا PlayStation 5 المطورة وصور بثك ومقاطع فيديو عالية الدقة بكل سلاسة ووضوح.</li>\r\n	<li>احصل على اللقطة المثالية مع الحامل المدمج القابل للتعديل للكاميرا عالية الدقة. كما يسمح تصميمها المدمج بوضعها بأمان فوق أجهزة التلفزيون أو أسفلها، حيث يمكنك ضبط الزاوية لتناسب إعدادك.</li>\r\n	<li>استمتع بعمليات الإنتاج الرائعة باستخدام أدوات إزالة الخلفية المدمجة الخاصة بجهاز PlayStation 5 (القدرة على قص الخلفية أو إزالتها تمامًا مع الشاشة الخضراء)</li>\r\n	<li>صور نفسك بدقة ووضوح وجودة عالية فل اتش دي مع عدسات الكاميرا المزدوجة ذات الزاوية العريضة بينما تستمتع بلحظات اللعب الملحمية. قم ببدء التسجيل أو البث لنفسك ولتجربة لعبك بسرعة باستخدام زر إنشاء اللاسلكية دوال سنس</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(235, 118, 1, 'Sony Dualshock 4', '<p>Innovative console design - features a clickable, capacitive multi-touch touchpad that can be clicked, taped, or swipe for new gameplay possibilities. The Rumble feature takes you deeper into the game, two vibration motors interact with your games to give you a tangible sense of impact when interacting</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(236, 118, 2, 'ذراع سوني دوال شوك 4', '<p>تصميم مبتكر لوحدة التحكم - يتميز بلوحة لمس سعوية متعددة اللمس قابلة للنقر يمكن النقر عليها أو النقر عليها أو تمريرها للحصول على إمكانيات لعب جديدة. تأخذك ميزة الدمدمة إلى عمق اللعبة ، يتفاعل محركان للاهتزاز مع ألعابك لمنحك إحساسًا ملموسًا بالتأثير عند التفاعل</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
