(267, 134, 1, 'Nokia 105', '<p>Screen type: TFT &quot;supports 65 thousand colors&quot;.<br />\r\nScreen size: 1.4 inches.<br />\r\nScreen resolution: 120 * 160 pixels.<br />\r\nPixel density: 143 pixels per inch.<br />\r\n&nbsp;<br />\r\nOperating system: Nokia Series operating system.<br />\r\nRandom memory &laquo;RAM&raquo;: 4 MB.<br />\r\nInternal memory: 4 MB.<br />\r\nExternal memory: The phone does not allow the use of external memory cards.<br />\r\n&nbsp;<br />\r\nBack camera: The phone does not have a rear camera.<br />\r\nFront camera: This phone does not have a front camera.<br />\r\n&nbsp;<br />\r\nSound: The phone supports Polyphonic ringtones and vibration.<br />\r\nLoudspeaker: Supports.<br />\r\nRadio: Supports.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(268, 134, 2, 'نوكيا 105', '<ul>\r\n	<li>نوع الشاشة: TFT &laquo;تدعم 65 ألف لون&raquo;.</li>\r\n	<li>حجم الشاشة : 1.4 بوصة.</li>\r\n	<li>جودة الشاشة : 120 * 160 بكسل.</li>\r\n	<li>كثافة البكسلات : 143 بكسل لكل بوصة.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>نظام التشغيل : يعمل بنظام تشغيل Nokia Series.</li>\r\n	<li>الذاكرة العشوائية &laquo;رام&raquo;: 4 ميجابايت.</li>\r\n	<li>الذاكرة الداخلية : 4 ميجابايت.</li>\r\n	<li>الذاكرة الخارجية : لا يسمح الهاتف باستخدام بطاقات الذاكرة الخارجية.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>الكاميرا الخلفية : لا يضم الهاتف كاميرا خلفية.</li>\r\n	<li>الكاميرا الأمامية : لا يضم هذا الهاتف كاميرا أمامية.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>الصوت : يدعم الهاتف نغمات Polyphonic وخاصية الاهتزاز.</li>\r\n	<li>مكبر الصوت : يدعم.</li>\r\n	<li>الراديو : يدعم.</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>البطارية: بطارية قابلة للإزالة من فئة Li-Ion &nbsp;بسعة 800 مللي أمبير.</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
