(318, 159, 2, 'مقوي شبكة الإنترنت', '<p>مقوي شبكة الإنترنت من TP-link&nbsp; موديل AC750 فقط ب 200 ريال<br />\r\nالمواصفات :<br />\r\n&nbsp;يعزز تغطية خدمة الواي فاي الحالية لتقديم اتصال سلكي ولاسلكي سريع وموثوق به&nbsp;<br />\r\n&nbsp;مزوَّد باثنتين من الهوائيات الخارجية تضمن إشارة لاسلكية ثابتة تصل إليك في كل مكان&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(319, 160, 1, 'TP LINK WIFI', '<pre>\r\nInternet booster from TP-link, only 300 riyals\r\nSpecifications:\r\n It strengthens the Wi-Fi signal to the Internet.\r\n This repeater gives you a wireless internet speed of 300Mbps for 802.11n\r\n Functional and modern design\r\n It has an Ethernet port that works as a wireless adapter so you can convert it from a wired device to a wireless one.</pre>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(320, 160, 2, 'مقوي شبكة الإنترنت', '<p>مقوي شبكة الإنترنت من TP-link&nbsp; فقط ب 300 ريال<br />\r\nالمواصفات :<br />\r\n&nbsp;يقوم بتقوية إشارة الواي فاي للإنترنت.&nbsp;<br />\r\n&nbsp;يقدم لك مقوي الإشارة سرعة إنترنت لاسلكية مقدارها 300 ميجابايت بالثانية 802.11n&nbsp;<br />\r\n&nbsp;تصميم عملي وعصري&nbsp;<br />\r\n&nbsp;يحتوي على مدخل إيثرنت يعمل كمحول لاسلكي حتى يمكنك تحويله من جهاز سلكي إلى لاسلكي.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(321, 161, 1, 'Router tp link', '<pre>\r\nTP-link router MR100 is only 350 SAR\r\nSpecifications:\r\n 150Mbps wireless speed is ideal for blackouts\r\n Sensitive applications such as HD video streaming\r\n Supports approximately 32 4G devices\r\n Micro SIM card\r\nEthernet port - 2 antennas</pre>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
