(595, 298, 1, 'phone Azom Desert 2', '<p>Azom Desert 2 weighs 180 grams and is light in weight.</p>\r\n\r\n<p>- Phone dimensions: 157 x 75.9 x 8.5 mm.</p>\r\n\r\n<p>Screen size: 6.4 inches.</p>\r\n\r\n<p>Screen aspect ratio: The phone comes with the new screen dimensions.</p>\r\n\r\n<p>- The phone supports two SIM cards 1 and SIM 2 nano-sized.</p>\r\n\r\n<p>- The phone supports the addition of an external storage card of up to 256 GB.</p>\r\n\r\n<p>The phone supports the Type-C port for charging.</p>\r\n\r\n<p>The phone supports the fingerprint sensor.</p>\r\n\r\n<p>The traditional 3.5 mm headphone port has not been dispensed with.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(596, 298, 2, 'هاتف عزوم ديزرت 2', '<p>يأتي هاتف&nbsp;<a href=\\\"https://www.mobihall.com/search.php?q=Azom&amp;catid=&amp;type=y\\\" target=\\\"_blank\\\">Azom Desert 2</a>&nbsp;بوزن 180 جرام وهو وزن خفيف.&nbsp;</p>\r\n\r\n<p>- أبعاد الهاتف: 157 &times; 75.9 &times; 8.5 ملم.</p>\r\n\r\n<p>- قياس الشاشة: 6.4 بوصة.</p>\r\n\r\n<p>- نسبة أبعاد الشاشة: يأتي الهاتف مع الأبعاد الجديدة للشاشة.&nbsp;</p>\r\n\r\n<p>- يدعم الهاتف منفذين لشريحتي الاتصال SIM 1 و SIM 2 بحجم Nano.</p>\r\n\r\n<p>- يدعم الهاتف إضافة بطاقة تخزين خارجية تصل إلى 256 جيجابايت.&nbsp;</p>\r\n\r\n<p>- يدعم الهاتف منفذ الـ Type-C في الشحن.</p>\r\n\r\n<p>-يدعم الهاتف مستشعر بصمة الأصابع.</p>\r\n\r\n<p>-لم يتم الاستغناء عن منفذً سماعات الرأس التقليدي بقطر 3.5 مللي.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
