(607, 304, 1, 'كيبل ايفون cm 30', '<pre>\r\n# Specifications\r\n= High efficiency charging cable\r\n= Supports fast charging\r\n= Supports data transfer\r\n= stable performance\r\n= Supports iq (intelligent identification) technology, which can identify the type of your device and give it the highest and best possible speed\r\n= Supports PowerBoost technology, which gives safe and fast charging with stable performance\r\n= Compatible with Apple products\r\n= iPhone compatible\r\n= Compatible with iPad\r\n= Identical to Apple&#39;s specifications\r\n= Conforms to international specifications and standards</pre>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(608, 304, 2, 'كيبل ايفون cm 30', '<p># المواصفات = كيبل شحن ذو كفاءة عالية = يدعم الشحن السريع = يدعم نقل البيانات = ثبات في الأداء = يدعم تقنية iq (التعرف الذكي)، والتي تستطيع التعرف على نوع جهازك واعطائه أعلى وأفضل سرعة ممكنة = يدعم تقنية PowerBoost، والتي تعطي شحن آمن وسريع مع ثبات في الأداء = متوافق مع منتجات شركة أبل APPLE = متوافق مع الايفون = متوافق مع الايباد = مطابق لمواصفات أبل APPLE = مطابق للمواصفات والمقاييس العالمية</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
