(616, 308, 2, 'كيبل TYPE-C قماش مترين ووبو', '<p>المواصفات</p>\r\n\r\n<p>الطول مترين</p>\r\n\r\n<p>يدعم خاصية الشحن السريع</p>\r\n\r\n<p>نقل بيانات سريع</p>\r\n\r\n<p>عمر افتراضي طويل</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(617, 309, 1, 'كيبل ايفون قماش مترين وبو', '<pre>\r\n# Specifications = Highly compatible, efficient charging cable = Made of cloth = More strong and durable = High durability up to 80 kg = Contains smart chips = Stability in performance = Supports fast charging (2.4A) = Supports data transfer = Supports iPhone 11 Pro = Supports iq (smart identification) technology, which can identify the type of your device and give it the highest and best possible speed = Supports PowerBoost technology, which gives safe, fast and stable charging = Compatible with Apple products = Compatible with iPhone = Compatible with iPad = Compatible with specifications APPLE</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(618, 309, 2, 'كيبل ايفون قماش مترين وبو', '<p># المواصفات = كيبل شحن ذو كفاءة بتوافق عالي = مصنوع من القماش = أكثر قوة ومتانة = قوة تحمل عالية تصل الى 80 كجم = يحتوي رقائق ذكية = ثبات في الأداء = يدعم الشحن السريع (2.4A) = يدعم نقل البيانات = يدعم ايفون 11 برو = يدعم تقنية iq (التعرف الذكي)، والتي تستطيع التعرف على نوع جهازك واعطائه أعلى وأفضل سرعة ممكنة = يدعم تقنية PowerBoost، والتي تعطي شحن آمن وسريع وثبات في الأداء = متوافق مع منتجات أبل APPLE = متوافق مع الايفون = متوافق مع الايباد = مطابق لمواصفات أبل APPLE</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
