(621, 311, 1, 'Huawei matepad T8', '<p>Screen: 8-inch IPS LCD capacitive touchscreen, 16 million colors<br />\r\nCamera: 5 MP back camera, 2 MP front camera<br />\r\nMemory: 16 GB internal storage, 2 GB RAM<br />\r\nProcessor: MediaTek MT8768 Octa-Core<br />\r\nBattery Capacity: 5100mAh<br />\r\nNumber of SIMs: Single SIM<br />\r\nOperating System: Android 10, EMUI 10.1 without Google Play Services<br />\r\nConnectivity: Wi-Fi, GPS, Bluetooth 5.0, Micro USB 2.0, USB OTG</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(622, 311, 2, 'تابلت هواوي ميت باد T8', '<ul>\r\n	<li><strong>الشاشة:</strong>&nbsp;شاشة لمس IPS LCD سعوية بحجم 8 بوصة، 16 مليون لون</li>\r\n	<li><strong>الكاميرا:</strong>&nbsp;كاميرا خلفية بدقة 5 ميجا بكسل، وكاميرا أمامية بدقة 2 ميجا بكسل</li>\r\n	<li><strong>الذاكرة:</strong>&nbsp;سعة تخزينية داخلية 16جيجا، وذاكرة رام 2 جيجا</li>\r\n	<li><strong>البروسيسور (المعالج):</strong>&nbsp;معالج ميدياتك MT8768 ثماني النواة</li>\r\n	<li><strong>سعة البطارية:</strong>&nbsp;5100 مللي أمبير في الساعة</li>\r\n	<li><strong>عدد شرائح الاتصال:</strong>&nbsp;شريحة SIM واحدة</li>\r\n	<li><strong>نظام التشغيل:</strong>&nbsp;نظام أندرويد 10، EMUI 10.1 بدون خدمات جوجل بلاي</li>\r\n	<li><strong>الاتصال:</strong>&nbsp;واي فاي، جي بي اس، بلوتوث 5.0، منفذ ميكرو يو اس بي 2.0، يو اس بي او تي جي</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(623, 312, 1, 'Lenovo Tab M7', '<p>Screen: 7-inch HD (Ultra High Definition) touch screen with WVA (Advanced Color Realistic Technology)<br />\r\nCamera: 2MP rear camera and 2MP front camera<br />\r\nMemory: 32GB internal storage, 2GB RAM<br />\r\nProcessor: MediaTek MT8765 Quad Core<br />\r\nBattery capacity: 3500 mAh battery<br />\r\nNumber of SIM cards: Single SIM<br />\r\nConnectivity: Bluetooth, Wi-Fi, Micro USB 2.0</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(624, 312, 2, 'لينوفو تاب M7', '<ul>\r\n	<li><strong>الشاشة:</strong>&nbsp;شاشة تعمل باللمس 7 بوصة بدقة HD (عالية الوضوح) وتقنية WVA (تقنية متطورة لعرض الألوان بواقعية)</li>\r\n	<li><strong>الكاميرا:</strong>&nbsp;كاميرا خلفية بدقة 2 ميجا بكسل وكاميرا أمامية بدقة 2 ميجا بكسل</li>\r\n	<li><strong>الذاكرة:</strong>&nbsp;سعة تخزين داخلية 32 جيجا، وذاكرة رام 2 جيجا</li>\r\n	<li><strong>البروسيسور:</strong>&nbsp;ميدياتك MT8765 رباعي النواة</li>\r\n	<li><strong>سعة البطارية:</strong>&nbsp;بطارية بقوة 3500 مللي أمبير في الساعة</li>\r\n	<li><strong>عدد شرائح الاتصال:</strong>&nbsp;شريحة واحدة</li>\r\n	<li><strong>إمكانية الاتصال:</strong>&nbsp;بلوتوث، وواي فاي، ومنفذ ميكرو USB 2.0</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
