(708, 354, 2, 'ساعة شاومي باند 5  تقليد', '<pre>\r\n.</pre>\r\n\r\n<ul>\r\n	<li>إمكانية التحكم في تطبيق الكاميرا عن طريق الساعة.</li>\r\n	<li>&nbsp;الساعة متوافقة مع لتعمل على نظام IOS وAndroid.</li>\r\n	<li>&nbsp;شاشة الساعة تعمل عن طريق اللمس بأصبعك.</li>\r\n	<li>&nbsp;الساعة تأتي مقاومة للماء حتى 50 متر لمدة نصف ساعة.</li>\r\n	<li>&nbsp;الذاكرة الصلبة لساعة Band 5 تقدر بسعة 16MB والذاكرة العشوائية بسعة 512KB.</li>\r\n	<li>&nbsp;أصبح يوجد إنذار في حالة وجود مشكلة في النبض المعتاد.</li>\r\n	<br />\r\n	<br />\r\n	&nbsp;\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(709, 355, 1, 'BUDS سماعة شاومي بلوتوث', '<pre>\r\nMicrophone Included: Yes\r\nNoise canceling: yes\r\nExternal Product ID : 6934177708800\r\nBrand: Xiaomi شا\r\nExternal Product ID Type : EAN-13\r\nCommunication methods: wireless\r\nModel Number : Redmi-R\r\nType: in the ear\r\nCompatible with: all devices\r\nHeadphone battery: 40 mAh\r\nCall time: 4 hours\r\nCharging time: 1.5 hours\r\nRecharging box: 300 mAh\r\nCharging time: 2 hours\r\nStandby time: 150 hours\r\nbluetooth...</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(710, 355, 2, 'BUDS سماعة شاومي بلوتوث', '<ul>\r\n	<li>تشمل الميكروفون : نعم</li>\r\n	<li>عازل للضجيج : نعم</li>\r\n	<li>معرف المنتج الخارجي : 6934177708800</li>\r\n	<li>العلامة التجارية : شاومي</li>\r\n	<li>نوع معرف المنتج الخارجي : EAN-13</li>\r\n	<li>طرق الاتصال : لا سلكي</li>\r\n	<li>رقم الموديل : Redmi-R</li>\r\n	<li>نوع : في الاذن</li>\r\n	<li>متوافق مع : كافة الاجهزة</li>\r\n	<li>بطارية السماعة : 40 ملي امبير</li>\r\n	<li>مدة المكالمات : 4 ساعات</li>\r\n	<li>مدة الشحن : 1.5 ساعة</li>\r\n	<li>صندوق اعادة الشحن : 300 ملي امبير</li>\r\n	<li>مدة الشحن : 2 ساعة</li>\r\n	<li>مدة الاستعداد : 150 ساعة</li>\r\n	<li>بلوتوث ...</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(723, 362, 1, 'شاحن pd ووبو', '<pre>\r\nsmall size\r\n\r\nWOPOW wall charger, small in size and beautiful design, as well as suitable for all uses (home and work).\r\n\r\nPD compatible fast charging\r\n\r\nCompared to other chargers.\r\n\r\nhigh quality design\r\n\r\nThis Wopow charger is made of PC material.\r\n\r\nheat resistant\r\n\r\nWOPOW wall charger, high temperature resistant.</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(724, 362, 2, 'شاحن pd ووبو', '<ol>\r\n	<li>\r\n	<p>صغير الحجم</p>\r\n\r\n	<p>شاحن جداري WOPOW، من الشواحن الصغيرة الحجم وبتصميم جميل، وكذلك مناسب لجميع&nbsp;الاستخدامات&nbsp;(السفر والمنزل والعمل).</p>\r\n	</li>\r\n	<li>\r\n	<p>الشحن السريع المتوافق PD</p>\r\n\r\n	<p>يتميز بالشحن السريع، مقارنة مع باقي الشواحن الأخرى.</p>\r\n	</li>\r\n	<li>\r\n	<p>تصميم عالي الجودة</p>\r\n\r\n	<p>تم صنع هذا الشاحن من شركة ووبو من مادة البولي كربونات PC.</p>\r\n	</li>\r\n	<li>\r\n	<p>مقاوم للحرارة</p>\r\n\r\n	<p>WOPOW&nbsp;&nbsp;شاحن جداري، مقاوم للحرارة العالية أو الإنفجار الكهربائي أو حماية من الكهرباء القوية.</p>\r\n	</li>\r\n</ol>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(725, 363, 1, '4-1شاحن منزلي دجت بلاس', '<pre>\r\nSupports all iPhone devices, AirPods and Apple Watch through 3 bases with a distinctive design.\r\nSupports all Android devices (Huawei / Samsung / Xiaomi / Oppo / Lenovo /&hellip;) and all tablets and tablets through 3 ports:\r\nType-C / Micro USB / Lighting Base</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(726, 363, 2, '4-1شاحن منزلي دجت بلاس', '<p>يدعم كافة اجهزة آيفون سماعات الايربود و ساعة ابل من خلال 3 قواعد بتصميم مميز.<br />\r\nيدعم كافة اجهزة اندرويد (هواوي / سامسونج / شاومي / اوبو / لينوفو /&hellip;) و كافة الاجهزة اللوحية و التابلت من خلال 3 منافذ:<br />\r\nType-C / Micro USB / قاعدة الإضاءة</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(727, 364, 1, 'شاحن سيارة وبو2.4', '<pre>\r\nFor type: car charger\r\nCompatible with : Phones\r\nBrand: Wubo\r\nTwo charging inputs\r\nSupports IQ charging</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(728, 364, 2, 'شاحن سيارة وبو2.4', '<ul>\r\n	<li>النوع : شاحن سيارة</li>\r\n	<li>متوافق مع : هواتف</li>\r\n	<li>العلامة التجارية : ووبو</li>\r\n	<li>مدخلين شحن</li>\r\n	<li>يدعم الشحن الاي كيو</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(729, 365, 1, '10000 باور بانك اكتيف', '<pre>\r\nBlack Active Titan Compact Portable Battery\r\n\r\nWith a USB A port and a Type-C port for charging smart phones.\r\n\r\nAnd you can recharge the mobile battery through the Type-C port.\r\n\r\nallowed to be carried by plane\r\n\r\nIt features PD technology and a power of 20W to charge the iPhone super quickly from 0% to 50% within 30 minutes.\r\n\r\nAnd QC3.0 technology for safe charging of Android devices.\r\n\r\nAnd IQ technology for smart tariff that gives the mobile the energy it needs.</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(730, 365, 2, '10000 باور بانك اكتيف', '<p>بطارية اكتيف تايتن كومباكت المتنقلة باللون الاسود</p>\r\n\r\n<p>بمنفذ USB A ومنفذ Type-C لشحن الهوتف الذكية.</p>\r\n\r\n<p>وتستطيع اعادة شحن البطارية المتنقلة عن طريق منفذ الـ Type-C.</p>\r\n\r\n<p>مسموح حملها بالطائرة,</p>\r\n\r\n<p>تتميز بتقنية PD وبقوة 20 واط لشحن الآيفون بسرعة فائقة من 0% الى 50% خلال 30 دقيقة.</p>\r\n\r\n<p>وتقنية الـ QC3.0 للشحن الامن لاجهزة الاندرويد.</p>\r\n\r\n<p>وتقنية الـ IQ للتعرفة الذكية اللي تعطي الجوال الطاقة اللي يحتاجها.</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(731, 366, 1, 'شاحن جداري بمنفذين 24 واط', '<pre>\r\nRAVPower 24W wall charger fits all devices, two USB-A ports, supports iSmart technology for fast charging, charges iPhone, iPad, Android devices and all smart devices</pre>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(732, 366, 2, 'شاحن جداري  منفذين', '<h1>شاحن جداري&nbsp; 24واط ماركة راف بور&nbsp;RAVPower يناسب جميع الأجهزة, منفذين يو اس بي USB-A تدعم تقنية آي سمارت للشحن السريع, يشحن أجهزة الايفون والآيباد : وأجهزة الاندرويد وجميع الأجهزة الذكية</h1>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
