(745, 373, 1, 'رسيفر فوكس كبير', '<pre>\r\nSunplus processor\r\nEquipped with 1 USB back\r\nThe ability to view video files from the computer in MPEG format\r\nA very high internal space of up to 5000 stations\r\nSupports updating of software and data through USB flash drive\r\nThe device supports the operation of the DIC 1.0 1.2\r\nIt can be operated on a moving motor to receive all satellites\r\nMultilingual (Arabic - English - French - &hellip;&hellip;&hellip;)\r\nSupports channel control (modify, delete, move)\r\nMultiple channel search (manual, automatic)\r\nSupports 8 favorite channel packages\r\nThe device supports recording and display\r\nSupport PAL (4:3, 16:9 .) playback\r\nSupports the zoom feature to enlarge and reduce the screen\r\nEasy to control, program and update\r\nAlphabet channel search feature\r\nSupports Wi-Fi and 3G - Play YouTube</pre>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(746, 373, 2, 'رسيفر فوكس', '<ul>\r\n	<li>معالج صن بلص</li>\r\n	<li>مزدو ب1 USB خلفى&nbsp;</li>\r\n	<li>امكانية عرض ملفات الفيديو من الكمبيوتر بصيغة MPEG</li>\r\n	<li>مساحة داخلية عالية جدا تصل الى 5000 محطة</li>\r\n	<li>يدعم التحديث للسوفت وير والنقوات من خلال فلاشة USB</li>\r\n	<li>الجهاز يدعم تشغيل الدايذك 1.0 1.2</li>\r\n	<li>يمكن تشغيلة على موتور متحرك لاستقبال جميع الاقمار الصناعية</li>\r\n	<li>متعدد اللغات &rlm;(&rlm; العربية &ndash; الانجليزية &ndash; الفرنسية &ndash; &hellip;&hellip;&hellip; &rlm;)&rlm;</li>\r\n	<li>يدعم التحكم بالقنوات &rlm;(&rlm; تعديل ، حذف ، نقل &rlm;)&rlm;</li>\r\n	<li>متعدد البحث عن القنوات &rlm;(&rlm; يدوى ، ألى &rlm;)&rlm;</li>\r\n	<li>يدعم 8 باقات مفضلة للقنوات</li>\r\n	<li>الجهاز يدعم التسجيل والعرض</li>\r\n	<li>يدعم تشغيل &rlm;(&rlm; PAL &rlm;(&rlm; 4&rlm;:&rlm;3 ، 16&rlm;:&rlm;9</li>\r\n	<li>يدعم خاصية الزووم لتكبير وتصغير الشاشة</li>\r\n	<li>سهل التحكم والبرمجة والتحديث</li>\r\n	<li>خاصية البحث عن القناة بالابجدية</li>\r\n	<li>يدعم الواي فاي والثري جي &lrm;- تشغيل يوتيوب</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
