(791, 396, 1, 'Falcon F5 Mini for Pubg Game', '<ul>\r\n	<li>Arm for easy control of the PUBG game&nbsp;</li>\r\n	<li>Compatible with Android and IOS</li>\r\n	<li>Easy to use and small in size</li>\r\n	<li>40 mAh battery</li>\r\n	<li>Charging time 2 hours</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(792, 396, 2, 'وحدة تحكم ميني Falcon F5', '<ul>\r\n	<li>ذراع لسهولة التحكم في لعبة ببجي&nbsp;</li>\r\n	<li>متوافقة مع اندرويد و IOS&nbsp;</li>\r\n	<li>سهلة الإستعمال وصغيرة الحجم&nbsp;</li>\r\n	<li>بطارية سعة 40 مللي امبير&nbsp;</li>\r\n	<li>مدة الشحن ساعتين&nbsp;</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(793, 397, 1, 'AirPods Joyroom 5th Edition', '<p>New developed version</p>\r\n\r\n<p>■ The best, finest and purest types of headphones on the market</p>\r\n\r\n<p>■ Replica in shape and size</p>\r\n\r\n<p>■ First class and very excellent quality</p>\r\n\r\n<p>■ The size of the box battery is 400mAh</p>\r\n\r\n<p>■ The battery size of one earphone is 45 mAh</p>\r\n\r\n<p>■ touch</p>\r\n\r\n<p>■ . Easily summon the voice assistant without buttons (Siri)</p>\r\n\r\n<p>■ Support wireless charging</p>\r\n\r\n<p>■ Bluetooth 5.0 is fast and stable</p>\r\n\r\n<p>■ Quickly pair with the phone by opening the case, easy to use</p>\r\n\r\n<p>■ Each headset works from 3 to 4 hours for continuous communication</p>\r\n\r\n<p>■ The case is charged with an iPhone charger</p>\r\n\r\n<p>■ The two headphones work together in communication, audio and video clips</p>\r\n\r\n<p>■ You can turn on a headset and leave the second in the pix</p>\r\n\r\n<p>2. Quickly pair with the phone by opening the case, easy to use</p>\r\n\r\n<p>3. New touch control technologies, easy and convenient control</p>\r\n\r\n<p>4. Intelligent noise reduction, clear sound, new two-channel audio technology</p>\r\n\r\n<p>6. Super energy saving, standby time up to 80 hours</p>\r\n\r\n<p>8. Compatible with IOS/ Android systems</p>\r\n\r\n<p>■ Works on all devices</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(794, 397, 2, 'سماعة أيربودز Joyroom الإصدار الخامس', '<p><strong>سماعات ايربودز من شركة جيروم الأصدار الأخير</strong></p>\r\n\r\n<p><strong>الاصدار الجديد المطور</strong></p>\r\n\r\n<p><strong>■ أفضل و أجود و أنقى أنواع السماعات الموجودة في السوق</strong></p>\r\n\r\n<p><strong>■ نسخة طبق الأصل بالشكل و الحجم</strong></p>\r\n\r\n<p><strong>■ درجة أولى و جودة جداً ممتازة</strong></p>\r\n\r\n<p><strong>■ حجم بطارية البوكس 400mAh</strong></p>\r\n\r\n<p><strong>■ حجم بطارية السماعة الواحده 45mAh</strong></p>\r\n\r\n<p><strong>■ تعمل باللمس</strong></p>\r\n\r\n<p><strong>■&nbsp;</strong><strong>. استدعاء المساعد الصوتي بكل سهولة بدون ازرار(</strong><strong>&nbsp;Siri)</strong></p>\r\n\r\n<p><strong>■ تدعم الشحن اللاسلكي</strong></p>\r\n\r\n<p><strong>■ اصدار البلوتوث 5.0&nbsp;</strong><strong>سريع وثابت</strong></p>\r\n\r\n<p><strong>■&nbsp;</strong><strong>اقتران بالهاتف بسرعة عن طريق فتح العلبة، استخدام سهل</strong></p>\r\n\r\n<p><strong>■ تعمل كل سماعة من3الى 4 ساعات للأتصال المتواصل</strong></p>\r\n\r\n<p><strong>■ يتم شحن العلبة بشاحن آيفون</strong></p>\r\n\r\n<p><strong>■ السماعتين تعمل معاً في الاتصال و مقاطع الصوت و الفيديو</strong></p>\r\n\r\n<p><strong>■ تقدر تشغل سماعه وتخلي الثانيه في البكس</strong></p>\r\n\r\n<p><strong>2. اقتران بالهاتف بسرعة عن طريق فتح العلبة، استخدام سهل</strong></p>\r\n\r\n<p><strong>3. تقنيات تحكم باللمس جديدة، تحكم سهل ومريح</strong></p>\r\n\r\n<p><strong>4. خفض الضوضاء الذكي, صوت نقي, تقنية صوت ثنائي القناة الجديدة</strong></p>\r\n\r\n<p><strong>6. توفير فائق للطاقة, زمن الانتظار حتى 80 ساعة</strong></p>\r\n\r\n<p><strong>8. متوافقة مع نظامي IOS/ Android</strong></p>\r\n\r\n<p><strong>■ تعمل على جميع الاجهزه</strong></p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(795, 398, 1, 'Xiaomi Mi 10T 5G', '<ul>\r\n	<li>Xiaomi Mi 10T Mobile Specifications</li>\r\n	<li>The mobile supports the installation of two SIM cards that support communication even 5G networks.</li>\r\n	<li>The mobile comes with a distinctive design with glass materials in Dahr with an aluminum frame, weighing 216 grams.</li>\r\n	<li>The back comes with a matte anti-fingerprint layer with a protection layer of the fifth generation Gorilla type.</li>\r\n	<li>The phone comes in only two colors, black and silver.</li>\r\n	<li>The screen comes from an IPS LCD type with a very small hole in the top left of the screen, and there is a protection layer on the screen from the fifth generation Gorilla Glass.</li>\r\n	<li>The screen comes in a size of 6.7 inches, with FHD + quality, with a resolution of 1080 x 2400 pixels, with a density of 395 pixels per inch, with support for HDR10, and it also comes with a refresh rate of 144 Hz.</li>\r\n	<li>The mobile processor is the most powerful Qualcomm Snapdragon 865 octa-core processor with 7 nano manufacturing technology with Adreno 650 graphic processor.</li>\r\n	<li>The phone comes with the Android 10 operating system with the latest Xiaomi MIUI 12 interface.</li>\r\n	<li>The mobile comes with an internal memory of 128 GB of the type UFS 3.1 with 8 GB of RAM, and the mobile does not support the installation of an external memory card.</li>\r\n	<li>The front camera is 20 mega-pixels with an F / 2.2 lens slot, supports video shooting up to FHD quality.</li>\r\n	<li>The rear camera is triple, where the main comes with a 64-megapixel camera with an F/1.9 lens slot, the second is a 13-megapixel Ultra Wide camera with an F/2.4 lens slot for wide-angle photography, and the third is a 5-megapixel macro camera with an F/2.4 lens slot for close-up photography, The cameras support video shooting up to 8K quality, and support the electronic stabilizer with 4K quality.</li>\r\n	<li>The battery comes with a capacity of 5000 mAh and supports fast charging with a power of 33 watts.</li>\r\n	<li>The fingerprint sensor is integrated with the power button, and it also supports the Face Unlock feature.</li>\r\n	<li>The phone comes with the latest and fastest Type C port with OTG support.</li>\r\n	<li>The phone comes with external stereo speakers.</li>\r\n	<li>The phone supports NFC and IR remote control.</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(796, 398, 2, 'شاومي مي 10T 5G', '<h2>مواصفات جوال شاومي مي 10 تي</h2>\r\n\r\n<ul>\r\n	<li>الجوال يدعم تركيب شريحتين اتصال يدعمان الاتصال حتي شبكات الجيل الخامس 5G .</li>\r\n	<li>الجوال يأتي بتصميم مميز بخامات من الزجاج في الضهر مع فريم من الألومنيوم بوزن 216 جرام .</li>\r\n	<li>الضهر يأتي عليه طبقة مطفية مضادة للتبصيم مع طبقة حماية من نوع جوريلا الجيل الخامس .</li>\r\n	<li>ويأتي الجوال بلونين فقط وهما الأسود والفضي .</li>\r\n	<li>الشاشة تاتي من نوع IPS LCDبشكل ثقب صغير جدا في اعلي يسار الشاشة , ويوجد طبقة حماية علي الشاشة من جوريلا جلاس الجيل الخامس .</li>\r\n	<li>الشاشة تأتي بحجم 6.7 بوصة بجودة FHD+ بدقة 1080&times;2400 بكسل بكثافة 395 بكسل في البوصة مع دعم خاصية HDR10 , كما تأتي بمعدل تحديث 144 هرتز .</li>\r\n	<li>معالج الجوال هو اقوي معالج من كوالكوم وهو Snapdragon 865 ثماني بتكنولوجيا تصنيع 7 نانو مع معالج رسومي Adreno 650 .</li>\r\n	<li>الجوال يأتي بنظام تشغيل اندرويد 10 مع واجهة تشغيل شاومي الاحدث MIUI 12 .</li>\r\n	<li>الجوال يأتي بذاكرة داخلية 128 جيجا بايت من نوع UFS 3.1 مع ذاكرة رام 8 جيجا بايت , والجوال لا يدعم تركيب كارت ذاكرة خارجي .</li>\r\n	<li>الكاميرا الامامية بدقة 20 ميجا بكسل بفتحة عدسة F/2.2 , تدعم تصوير فيديو حتي جودة FHD .</li>\r\n	<li>الكاميرا الخلفية ثلاثية حيث تأتي الرئيسية تأتي بدقة 64 ميجا بكسل بفتحة عدسة F/1.9, والثانية كاميرا الترا وايد بدقة 13 ميجا بكسل بفتحة عدسة F/2.4 للتصوير بزاوية واسعة , والثالثة كاميرا ماكرو بدقة 5 ميجا بكسل بفتحة عدسة F/2.4 للتصوير عن قرب , وتدعم الكاميرات تصوير فيديو حتي جودة 8K , ودعم المثبت الالكتروني مع جودة 4K .</li>\r\n	<li>البطارية تأتي بسعة 5000 مللي امبير وتدعم الشحن السريع بقوة 33 وات .</li>\r\n	<li>مستشعر البصمة مدمج مع زرار الباور , كما يدعم خاصية التعرف علي الوجه Face Unlock .</li>\r\n	<li>الجوال يأتي بمنفذ Type C الاحدث والاسرع مع دعم خاصية OTG .</li>\r\n	<li>الجوال يأتي بسماعات خارجية ستريو .</li>\r\n	<li>ويدعم الجوال خاصية NFC , ومستشعر التحكم عن بعد IR .</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(797, 399, 1, 'Xiaomi Mi 11 Lite', '<p>Main Specifications of Xiaomi Mi 11 Lite Mobile<br />\r\nScreen: 6.55 inches, OLED, with a resolution of 2400 * 1080 pixels<br />\r\nProcessor: Qualcomm Snapdragon 732G octa-core<br />\r\nGraphics Processor: Adreno 618<br />\r\nRAM: 6 or 8 GB<br />\r\nStorage capacity: 128 GB<br />\r\nBack camera: Triple lens, 64 + 8 + 5 mega-pixels<br />\r\nFront camera: one 16 MP<br />\r\nBattery: 4250 mAh<br />\r\nColor: blue</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(798, 399, 2, 'شاومي مي ١١ لايت', '<h2>أبرز مواصفات جوال&nbsp;&nbsp;شاومي مي 11 لايت</h2>\r\n\r\n<ul>\r\n	<li><strong>الشاشة</strong>: بمساحة 6.55 بوصة اوليد بدقة 2400*1080 بكسل</li>\r\n	<li><strong>المعالج</strong>: كوالكوم سناب دراجون 732G ثماني النواة</li>\r\n	<li><strong>معالج رسومي</strong>: ادرينو 618</li>\r\n	<li><strong>الرام</strong>: 6 أو 8 جيجا بايت</li>\r\n	<li><strong>سعة التخزين</strong>:&nbsp; 128 جيجا بايت</li>\r\n	<li><strong>الكاميرا الخلفية</strong>: ثلاثية العدسات بدقة 64+8+5 ميجا بكسل</li>\r\n	<li><strong>الكاميرا الأمامية</strong>: واحدة بدقة 16 ميجا بكسل</li>\r\n	<li><strong>البطارية</strong>: بقدرة 4250 ملي أمبير</li>\r\n	<li><strong>اللون&nbsp;</strong>:&nbsp; أزرق</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
