(835, 418, 1, 'Huawei  USB Type-C to Micro USB Adapter', '<p>PRODUCT DESCRIPTION USB-C TO MICRO USB ADAPTER THE SMALL AND SIMPLE USB-C CONVERTER HUGE USB COMPATIBILITY USE YOUR USB-C PHONE, TABLET OR COMPUTER WITH YOUR MICRO USB CABLES. ALLOWS YOU TO EASILY CONNECT YOUR USB-C PHONE TO ANY CHARGER OR COMPUTER. SUPREMELY SIMPLE JUST PLUG THE ADAPTERS USB-C PLUG</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(836, 418, 2, 'USB-C إلى MICRO USB محول', '<p>وصف المنتج من USB-C إلى MICRO USB محول محول USB-C الصغير والبسيط التوافق الضخم مع USB استخدم هاتف USB-C أو الكمبيوتر اللوحي أو الكمبيوتر مع كبلات USB الصغيرة. يتيح لك توصيل هاتف USB-C بسهولة بأي شاحن أو جهاز كمبيوتر. بسيط للغاية فقط قم بتوصيل المحولات USB-C PLUG</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(837, 419, 1, 'Huawei MediaPad T3 10\"', '<p>Huawei MediaPad T3 10&quot;</p>\r\n\r\n<p>Cool design, bright screen</p>\r\n\r\n<p>Enjoy the power of great design with the MediaPad T3 10 tablet. See the world full of brilliant colors through the 9.6 inch screen. Feel the quality of the design and body.</p>\r\n\r\n<p>clarity of vision</p>\r\n\r\n<p>MediaPad T3 10 tablet well, day or night, blue light vision aid program and reduces blue light, helping you sleep better</p>\r\n\r\n<p>joy</p>\r\n\r\n<p>MediaPad T3 10 Tablet, everything you need.</p>\r\n\r\n<p>Powerful with books, easy to use</p>\r\n\r\n<p>MediaPad T3 10 and EMUI 5.1 interface designed for use in an easy environment, built on the Android 7.0 operating system.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(838, 419, 2, 'هواوى ميديا باد T3 10', '<p><strong>هواوى ميديا باد T3 10&quot;</strong></p>\r\n\r\n<p><strong>الشريحة :</strong>&nbsp;شريحة ( نانو)<br />\r\nا<strong>لشاشة :</strong>&nbsp;9.6بوصة<br />\r\n<strong>الرامات :</strong>&nbsp;2جيجا بايت<br />\r\n<strong>الذاكرة الداخلية :</strong>&nbsp;16 جيجا بايت<br />\r\n<strong>الكاميرا:</strong>&nbsp;5 ميجا بيكسل<br />\r\n<strong>اللون :</strong>&nbsp;ذهبى</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>تصميم رائع، وشاشة مشرقة</strong></p>\r\n\r\n<p>تمتع بقوة التصميم الرائع مع تابلت MediaPad T3 10 ، شاهد العالم المليئ بالألوان الرائعة من خلال الشاشة بحجم 9.6 انش، اشعر بجودة التصميم والجسم الألومنيوم</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>وضوح الرؤية</strong></p>\r\n\r\n<p>تابلت MediaPad T3 10 دائماً معك، بالنهار أو الليل، ونظام حماية البصر يقلل من انبعاثات الضوء الأزرق ويقلل إجهاد العينين، مما يساعدك على النوم بشكل أفضل</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>المتعة المستمرة</strong></p>\r\n\r\n<p>تابلت MediaPad T3 10 هو رفيقك المخلص, طوال اليوم، سوف تضمن لك البطارية طويلة الأمد أن تحصل على كل ما تحتاجه وقتما تحتاجه.</p>\r\n\r\n<p><strong>قوي بالطبيعة، وسهل الاستخدام</strong></p>\r\n\r\n<p>سوف تشعر أنك دائما مع صديقك المخلص، مع MediaPad T3 10 وواجهة EMUI 5.1 المصممة بعناية للاستخدام السهل، مبنية على نظام تشغيل أندرويد 7.0 ومصممة لتجعل حياتك أفضل.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(839, 420, 1, 'Lenovo Tab M7', '<ul>\r\n	<li>Screen: 7-inch HD (Ultra High Definition) touch screen with WVA (Advanced Realistic Color Display)</li>\r\n	<li>Camera: 2MP rear camera and 2MP front camera</li>\r\n	<li>Memory: 32GB internal storage, 2GB RAM</li>\r\n	<li>Processor: MediaTek MT8765 Quad Core</li>\r\n	<li>Battery capacity: 3500 mAh battery</li>\r\n	<li>Number of SIM cards: Single SIM</li>\r\n	<li>Connectivity: Bluetooth, Wi-Fi, Micro USB 2.0</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
