(873, 437, 1, 'Mi TV Stick', '<p>For the Android device, the Xiaomi Mi TV Stick enjoys the full features of the Android system and can be relied upon to convert any screen that does not have a smart system into a screen running a full smart Android system, and among the most important specifications and features of the Android piece from Xiaomi:</p>\r\n\r\n<p>Xiaomi Mi TV Stick is small in size.<br />\r\nAndroid operating system version 9.0.<br />\r\nPicture resolution FHD 1080P Supports HDR (1920x1080 @ 60fps) HDR.<br />\r\n1 GB physical RAM.<br />\r\nThe internal memory is 8 GB, which is sufficient for normal use.<br />\r\nThe picture output is HDMI and therefore does not work on older TVs without an HDMI To AV converter.<br />\r\nQuad-core Cortex-A53 processor with a speed of up to 2.0GHz.<br />\r\nARM Mali 450 graphics processor.<br />\r\nSupports Bluetooth version 4.2.<br />\r\nSupports the 5G Wi-Fi network.<br />\r\nSupports the voice search feature through the Google asistanı feature.<br />\r\nSupports the Cast feature to display the phone screen on the TV.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(874, 437, 2, 'Mi Tv Stick', '<p>&nbsp;<a href=\\\"https://www.raeedtk.com/2020/08/android-box.html\\\" target=\\\"_blank\\\">لجهاز الأندرويد</a>&nbsp;شاومي تيفي ستيك&nbsp;Xiaomi Mi TV Stick&nbsp; يتمتع بمميزات نظام الأندرويد الكاملة ويمكن الإعتماد عليه&nbsp;لتحويل أي شاشة لا تحتوي نظام سمارت الى شاشة تعمل بنظام سمارت اندرويد كامل ، ومن أهم مواصفات ومميزات قطعة الأندرويد من شركة شاومي:</p>\r\n\r\n<ul>\r\n	<li>قطعة&nbsp;Xiaomi Mi TV Stick صغيرة الحجم .</li>\r\n	<li>نظام التشغيل أندرويد اصدار 9.0 .</li>\r\n	<li>دقة الصورة FHD 1080 P يدعم HDR&nbsp;(1920x1080 @ 60fps)&nbsp; &nbsp;HDR .</li>\r\n	<li>الذاكرة العشوائية الرام 1 جيغا فعلي .</li>\r\n	<li>الذاكرة الداخلية&nbsp; 8 جيغا وتعتبر كافية للإستخدام الطبيعي.</li>\r\n	<li>مخرج الصورة HDMI وبالتالي لا تعمل على التلفزيونات القديمة دون جهاز تحويل HDMI To AV.</li>\r\n	<li>معالج رباعي النواة من نوع&nbsp;Cortex-A53 بسرعة تصل حتى&nbsp; 2.0GHZ .</li>\r\n	<li>معالج روسميات من نوع&nbsp;ARM Mali 450 .</li>\r\n	<li>يدعم بلوتوث اصدار&nbsp;Bluetooth 4.2 .</li>\r\n	<li>يدعم شبكة الإتصال واي فاي بتردد 5G .</li>\r\n	<li>يدعم ميزة البحث الصوتي من خلال ميزة&nbsp;Google asistanı .</li>\r\n	<li>يدعم ميزة كاست لعرض شاشة الهاتف على التلفزيون.</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
