(909, 455, 1, 'Playstation 5 , Sony + CD', '<p><br />\r\nGraphics Processor: AMD Radeon RDNA 2 with performance up to 10.3 teraflops<br />\r\nRAM: 16GB GDDR6, 448Gbps data transfer rate<br />\r\nStorage: 825GB SSD, 5.5Gbps.<br />\r\nVideo: Support for connection to screens with a resolution of up to 4K at a frequency of 120 Hz, in addition to support for connection to TVs with a resolution of 8K.<br />\r\n&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(910, 455, 2, 'بلاي ستيشن 5 ، سوني +CD', '<p>المعالج: AMD Zen 2 ثماني النواة بتردد متغير حتى 3.5 جيجاهرتز<br />\r\nمعالج الرسوميات: AMD Radeon RDNA 2 بأداء يصل إلى 10.3&nbsp;تيرافلوبس<br />\r\nذاكرة الوصول العشوائي: GDDR6 بسعة 16 جيجابايت، بمعدل نقل بيانات 448 جيجابت/الثانية<br />\r\nالمساحة التخزينية: SSD بسعة 825 جيجابايت، بسرعة 5.5 جيجابت/الثانية.&nbsp;<br />\r\nالفيديو: دعم التوصيل بشاشات بدقة حتى 4K بتردد 120 هرتز، بالإضافة لدعم التوصيل بالتلفزيونات بدقة 8K.&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(911, 456, 1, 'Mi TV stick', '<p>The Xiaomi Mi TV Stick Android device with the full Android system features and can be relied upon to convert any screen containing a smart system into a screen running a full smart Android system, and among the most important specifications and features of the Android piece from Xiaomi:</p>\r\n\r\n<p>The Xiaomi Mi TV Stick is small in size.<br />\r\nAndroid operating system version 9.0.<br />\r\nPicture Resolution FHD 1080P Supports HDR (1920x1080 @ 60fps) HDR.<br />\r\nRAM 1 GB google.<br />\r\nThe internal memory is 8 GB, the service is for normal use.<br />\r\nHDMI picture output.<br />\r\nQuad-core Cortex-A53 processor with a speed of up to 2.0GHz.<br />\r\nARM Mali 450 graphics processor.<br />\r\nBluetooth supports Bluetooth version 4.2.<br />\r\nSupports the 5G Wi-Fi network.<br />\r\nVoice feature support in Google asistanı support feature.<br />\r\nSupports the Cast Display feature.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(912, 456, 2, 'Mi TV stick', '<p>جهاز الأندرويد شاومي تيفي ستيك Xiaomi Mi TV Stick معميزات نظام الأندرويد الكاملة ويمكن الاعتماد عليه لتحويل أي شاشة تحتوي نظام سمارت إلى شاشة تعمل بنظام سمارت اندرويد كامل ، ومن أهم مواصفات ومميزات قطعة الأندرويد من شركة شاومي:</p>\r\n\r\n<p>قطعة Xiaomi Mi TV Stick صغيرة الحجم.<br />\r\nنظام التشغيل أندرويد اصدار 9.0.<br />\r\nدقة الصورة FHD 1080 P يدعم HDR (1920x1080 @ 60fps) HDR.<br />\r\nالذاكرة العشوائية الرام 1 جيغا google.<br />\r\nالذاكرة الداخلية 8 جيغا الخدمة للإستخدام الطبيعي.<br />\r\nمخرج الصورة HDMI.<br />\r\nمعالج رباعي النواة من نوع Cortex-A53 بسرعة تصل حتى 2.0GHZ.<br />\r\nمعالج روسميات من نوع ARM Mali 450.<br />\r\nيدعم بلوتوث اصدار بلوتوث 4.2.<br />\r\nيدعم شبكة الإتصال واي فاي بتردد 5G.<br />\r\nدعم ميزة الصوت في ميزة دعم Google asistanı.<br />\r\nيدعم ميزة كاست العرض.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
