(1001, 501, 1, 'Lead Bluetooth Headphone and Speaker', '<p>Specifications:</p>\r\n\r\n<p>* Wireless Headphone with Speaker</p>\r\n\r\n<p>* Bluetooth version: 5</p>\r\n\r\n<p>* Charging time: 2-3 hours</p>\r\n\r\n<p>* Bluetooth range 10-15m</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1002, 501, 2, 'سماعة رأس لاسلكية مع مكبر صوت من Lead', '<p>المواصفات :</p>\r\n\r\n<p>* سماعة لاسلكية مع مكبر صوت</p>\r\n\r\n<p>* بلوتوث إصدار : 5</p>\r\n\r\n<p>* وقت الشحن : 2-3 ساعات</p>\r\n\r\n<p>* نطاق البلوتوث 10-15 m</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1003, 502, 1, 'GQUI Desk Lighting Unit with Alarm Clock and Charger', '<p>Specifications:<br />\r\n* High quality leather design is durable enough to be used for a long time.<br />\r\n* Intelligent wireless charger can charge compatible mobile phones with a power of 10W.<br />\r\n* HD display with alarm function makes you in control of your time.<br />\r\n* 3 brightness levels meet different lighting requirements.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1004, 502, 2, 'وحدة إضاءة مكتبية مع منبة وشاحن من  GQUI', '<p>المواصفات :</p>\r\n\r\n<p>* تصميم جلد عالي الجودة متين بدرجة كافية ليتم استخدامه لفترة طويلة.</p>\r\n\r\n<p>* شاحن لاسلكي ذكي يمكن شحن الهواتف المحمولة المتوافقة بقوة 10 واط.</p>\r\n\r\n<p>* شاشة اتش دي مع وظيفة منبه تجعلك تتحكم في وقتك.</p>\r\n\r\n<p>* 3درجات سطوع تلبي متطلبات الإضاءة المختلفة.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0);
INSERT INTO `products_description` (`id`, `products_id`, `language_id`, `products_name`, `products_description`, `products_url`, `products_viewed`, `products_left_banner`, `products_left_banner_start_date`, `products_left_banner_expire_date`, `products_right_banner`, `products_right_banner_start_date`, `products_right_banner_expire_date`) VALUES
(1005, 503, 1, 'Eufy Security Camera from Anker', '<p>* Storage via Micro sd card<br />\r\n* The terrible feature is the presence of a battery that lasts for an entire year on a single charge<br />\r\n*Includes free cloud storage<br />\r\n* Recognize movements, faces and people who move in front of the camera<br />\r\n* Send notifications on a phone directly to any movement that occurs in front of the camera<br />\r\n* The presence of an excellent application on the phone with many options and works on Android and iOS<br />\r\n* Possibility to identify the movement of animals in front of the camera<br />\r\n* The wireless security camera does not need to be connected to a power source. It is able to stick to any metal object because it contains strong magnets<br />\r\n* The most important feature of these cameras is that they have artificial intelligence techniques that analyze videos, cut unimportant videos, and differentiate between familiar and unfamiliar faces.<br />\r\n* Resistant to water, dust, heat and harsh conditions<br />\r\n* Suitable for indoor and outdoor use</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1006, 503, 2, 'كاميرا مراقبة Eufy من Anker', '<p>* تخزين عن طريق Micro sd card</p>\r\n\r\n<p>* الميزة الرهيبة هي وجود بطارية تستمر لمدة عام كامل على شحنة واحدة</p>\r\n\r\n<p>* تتضمن تخزين سحابي مجاني</p>\r\n\r\n<p>* التعرف على الحركات والوجوه والاشخاص التي تتحرك امام الكاميرا</p>\r\n\r\n<p>* ارسال اشعارات على هاتف مباشرة لاي حركة تحدث امام الكاميرا</p>\r\n\r\n<p>* وجود تطبيق ممتاز على الهاتف بخيارات كثيرة و يعمل على الاندرويد و ios</p>\r\n\r\n<p>* امكانية التعرف على حركة الحيوانات امام الكاميرا</p>\r\n\r\n<p>* لا تحتاج كاميرا المراقبة اللاسلكية إلى توصيلها بمصدر للكهرباء. فهي قادرة على الالتصاق بأي جسم معدني لاحتوائها على مغناطيس قوي</p>\r\n\r\n<p>* الميزة الاهم في هذه الكاميرات هو امتلاكها تقنيات ذكاء اصطناعي تقوم بتحليل الفديوهات وقص الفديوهات الغير مهمة والتفريق بين الوجوه المألوفة وغير المألوفة</p>\r\n\r\n<p>* مضادة للماء والغبار والحرارة والظروف الصعبة</p>\r\n\r\n<p>* صالحة للاستخدام الداخلي والخارجي</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
