(1033, 517, 1, 'Crave Micro Cable', '<p>Living an active life means taking your smartphone, MP3 player or tablet with you wherever you go<br />\r\nThanks to the most in-demand cable; You can quickly charge all your favorite devices to take with you fully charged<br />\r\nIt works seamlessly with a large number of technologically advanced devices today<br />\r\nMade with professional grade cables wrapped in a highly durable material to ensure faster and more reliable connections<br />\r\nProtects against overcharging and surge current</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1034, 517, 2, 'كيبل مايكرو Crave', '<p>ن تعيش حياة ملؤها النشاط والحركة يعني أن تأخذ معك هاتفك الذكي، مشغل موسيقى MP3 أو الجهاز اللوحي أينما ذهبت<br />\r\nبفضل الكابل الأكثر طلباً؛ يمكنك شحن جميع أجهزتك المفضلة بسرعة لتأخذها معك وهي مشحونة بالكامل<br />\r\nيعمل بسلاسة مع عدد كبير من الأجهزة المتقدمة تكنولوجياً في وقتنا الحاضر<br />\r\nمصنوع من كابلات بدرجة احترافية ملفوفة في مادة متينة للغاية لضمان توصيلات أسرع وأكثر موثوقية<br />\r\nيحمي من الشحن الزائد والتدفق المفاجئ بالتيار</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
