(1039, 520, 1, 'Active IPhone Cable', '<p>Specifications</p>\r\n\r\n<p>Apple certified cable<br />\r\nFully compatible with Apple products<br />\r\nThe cable carries high strength and durability<br />\r\nMade of pure copper and fiber<br />\r\nThe fibers have been loaded more than 12,000 times<br />\r\nSupports fast charging<br />\r\nSupports data transfer<br />\r\nHigh and stable charging speed<br />\r\nStability in charging and data transfer</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1040, 520, 2, 'كيبل ايفون متر ربل من اكتف', '<p><strong>المواصفات</strong></p>\r\n\r\n<ul>\r\n	<li><strong>كيبل</strong>&nbsp;<strong>معتمد</strong>&nbsp;<strong>من</strong>&nbsp;<strong>شركة</strong>&nbsp;<strong>أبل</strong>&nbsp;<strong>الأمريكية</strong></li>\r\n	<li><strong>متوافق</strong>&nbsp;<strong>تماماً</strong>&nbsp;<strong>مع</strong>&nbsp;<strong>منتجات</strong>&nbsp;<strong>شركة</strong>&nbsp;<strong>أبل</strong></li>\r\n	<li><strong>الكيبل</strong>&nbsp;<strong>يحمل</strong>&nbsp;<strong>متانة</strong>&nbsp;<strong>وقوة</strong>&nbsp;<strong>عالية</strong></li>\r\n	<li><strong>مصنوع</strong>&nbsp;<strong>من</strong>&nbsp;<strong>النحاس</strong>&nbsp;<strong>النقي</strong>&nbsp;<strong>والألياف</strong></li>\r\n	<li><strong>ألياف</strong>&nbsp;<strong>تحمّل</strong>&nbsp;<strong>لأكثر</strong>&nbsp;<strong>من</strong>&nbsp;12&nbsp;<strong>ألف</strong>&nbsp;<strong>مرة</strong></li>\r\n	<li><strong>يدعم</strong>&nbsp;<strong>الشحن</strong>&nbsp;<strong>السريع</strong></li>\r\n	<li><strong>يدعم</strong>&nbsp;<strong>نقل</strong>&nbsp;<strong>البيانات</strong></li>\r\n	<li><strong>سرعة</strong>&nbsp;<strong>شحن</strong>&nbsp;<strong>عالية</strong>&nbsp;<strong>وثابتة</strong></li>\r\n	<li><strong>ثبات</strong>&nbsp;<strong>في</strong>&nbsp;<strong>الشحن</strong>&nbsp;<strong>ونقل</strong>&nbsp;<strong>البيانات</strong></li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
