(1046, 523, 2, 'كيبل هواوي تايب سي', '<ul>\r\n	<li>سلك شاحن تايب سي عالي الجودة من شركة هواوي&nbsp;</li>\r\n	<li>يدعم الشحن السريع للأجهزة الحديثة, بقوة شحن تصل إلى 5 امبير&nbsp;</li>\r\n	<li>امكانية شحن بطارية هاتف بسعة 4000 ملي امبير في اقل من ساعة ونصف&nbsp;</li>\r\n	<li>سرعة نقل بيانات تصل الى 480 ميجابايت في الثانية&nbsp;&nbsp;</li>\r\n	<li>يدعم بنك الطاقة والشواحن الاخرى المزودة بخاصية كويك تشارج او اي كيو, وجميع استخدامات مخارج تايب سي من هواتف محمولة, تابلت,لاب توب, والاجهزة الاخرى&nbsp;</li>\r\n	<li>يمتاز بالامان والسلامة للأجهزة ...</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
