(1152, 576, 2, 'منقي الهواء 2in1 من Momax', '<p>* ينقي الهواء مع H13 HEPA وفلاتر الكربون النشط.</p>\r\n\r\n<p>* يعمل مع درجات حرارة منخفضة لإزالة الرطوبة حتى 5 C &deg;</p>\r\n\r\n<p>* تحكم عن بعد بإستخدام تطبيق موماكس الذكي.</p>\r\n\r\n<p>* يساعد على خلق بيئة صحية أكثر صحة وراحة</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1153, 577, 1, 'Anker eufy smart vacuum cleaner', '<p>*100% hands-free cleaning.</p>\r\n\r\n<p>* 2.85 inch slim design, to reach under sofas and beds</p>\r\n\r\n<p>* Super strong 1500PA suction power to clean dust and fur</p>\r\n\r\n<p>* Continuous cleaning for up to 100 minutes</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1154, 577, 2, 'مكنسة eufy الذكية من Anker', '<p>* التنظيف بدون استخدام اليدين بنسبة 100٪.</p>\r\n\r\n<p>* تصميم نحيف مقاس 2.85 بوصة، للوصول أسفل الأرائك والأسرّة</p>\r\n\r\n<p>* قوة شفط فائقة القوة 1500PA لتنظف الغبار والفراء</p>\r\n\r\n<p>* تنظيف متواصل لمدة تصل إلى 100 دقيقة</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1155, 578, 1, 'Bod IPhone Fabric Cable', '<p>Made of high quality material that ensures reliable connections<br />\r\nHeavy duty and practical construction allows for long-term use<br />\r\nProvides ultra-fast speed while sending both audio and video<br />\r\nCable ensures fast charging and syncing</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1156, 578, 2, 'بود كيبل ايفون  قماش فابريك 2م', '<ul>\r\n	<li>مصنوع من مادة ذات جودة عالية تضمن توصيلات موثوقة</li>\r\n	<li>بنية ثقيلة وعملية تسمح بالاستخدام طويل الأمد</li>\r\n	<li>يوفر سرعة فائقة للغاية أثناء إرسال كل من الصوت والفيديو</li>\r\n	<li>كابل يضمن الشحن والمزامنة بسرعة عالية</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1157, 579, 1, 'Active IPhone Cable PD', '<p>Apple-certified cable<br />\r\nFully compatible with Apple products<br />\r\nThe cable carries high strength and durability<br />\r\nMade of pure copper and fiber<br />\r\nThe fibers have been loaded more than 12,000 times<br />\r\nSupports PD fast charging<br />\r\nSupports data transfer<br />\r\nHigh and stable charging speed<br />\r\nStability in charging and data transfer</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1158, 579, 2, 'كيبل ايفون PD من أكتف', '<ul>\r\n	<li>كيبل معتمد من شركة أبل الأمريكية</li>\r\n	<li>متوافق تماماً مع منتجات شركة أبل</li>\r\n	<li>الكيبل يحمل متانة وقوة عالية</li>\r\n	<li>مصنوع من النحاس النقي والألياف</li>\r\n	<li>ألياف تحمّل لأكثر من 12 ألف مرة</li>\r\n	<li>يدعم الشحن السريع PD</li>\r\n	<li>يدعم نقل البيانات</li>\r\n	<li>سرعة شحن عالية وثابتة</li>\r\n	<li>ثبات في الشحن ونقل البيانات</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1159, 580, 1, 'ِAnker IPhone Fabric Cable', '<p>Purpose: Lightning to USB 2.0 charging cable.<br />\r\nProduct type: Charging and data transfer cable.<br />\r\nSpecial Features: Premium Double-Nylon Braided Cable.<br />\r\nCord length: 90 cm, 3 feet.<br />\r\nColor: black.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1160, 580, 2, 'كيبل ايفون Anker قماش', '<ul>\r\n	<li>الغرض : سلك شحن &lrm;لايتنينج الى يو اس بي 2.0&lrm;.</li>\r\n	<li>نوع المنتج : كيبل شحن ونقل معلومات&lrm;.</li>\r\n	<li>مميزات خاصة : Premium Double-Nylon Braided Cable .</li>\r\n	<li>طول السلك : 90 سم، 3 قدم&lrm;.</li>\r\n	<li>اللون&lrm;: اسود.</li>\r\n</ul>\r\n\r\n<div id=\\\"gtx-trans\\\" style=\\\"position: absolute; left: 10px; top: -6px;\\\">\r\n<div class=\\\"gtx-trans-icon\\\">&nbsp;</div>\r\n</div>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1161, 581, 1, 'Anker Micro Cable', '<p>Equipped with aramid fiber construction for a stronger and more durable wire than conventional wires</p>\r\n\r\n<p>Equipped for heavy use, the cable has been twisted more than 5000 times and the shape or performance is not affected</p>\r\n\r\n<p>- High charging speed</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1162, 581, 2, 'أنكر مايكرو كيبل', '<p>&nbsp;</p>\r\n\r\n<p>- مجهز ببنية من ألياف الأراميد لسلك أقوى و أمتن من الأسلاك الاعتيادية</p>\r\n\r\n<p>- مجهز للأستخدام الثقيل حيث تم اختبار الكيبل للألتواء اكثر من 5000 مرة ولم يتاثر الشكل أو الأداء</p>\r\n\r\n<p>- سرعة عالية في الشحن</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1163, 582, 1, 'LED lamp and speaker for reciting the Holy Quran', '<p><font style=\\\"vertical-align: inherit;\\\"><font style=\\\"vertical-align: inherit;\\\">* وظيفة تعمل كمصباح LED وسماعة لتلاوة القرآن الكريم</font></font></p>\r\n\r\n<p><font style=\\\"vertical-align: inherit;\\\"><font style=\\\"vertical-align: inherit;\\\">* مصباح التلاوة الكاملة للقرآن الكريم مزود بجهاز تحكم عن بعد لاختيار القارئ أو السورة والاستماع إلى القرآن بالصوت.</font></font></p>\r\n\r\n<p><font style=\\\"vertical-align: inherit;\\\"><font style=\\\"vertical-align: inherit;\\\">* مصباح LED مع مكبر صوت لتلاوة القرآن الكريم يسمح بتعلم القرآن الكريم مع العائلة عند وضعه في الغرفة</font></font></p>\r\n\r\n<p><font style=\\\"vertical-align: inherit;\\\"><font style=\\\"vertical-align: inherit;\\\">* لها صوت ورنان جميلان لأنها مزودة بمكبر صوت عالي الدقة</font></font></p>\r\n\r\n<p><font style=\\\"vertical-align: inherit;\\\"><font style=\\\"vertical-align: inherit;\\\">قم بتشغيل أي سورة من القرآن عن طريق الضغط على زر في جهاز التحكم عن بعد.</font></font></p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1164, 582, 2, 'مصباح led ومكبر صوت لترتيل القرآن الكريم', '<p>* وظيفة حيث يعمل كمصباح LED ومكبر صوت لترتيل القرآن الكريم</p>\r\n\r\n<p>* مصباح التلاوة الكاملة للقرآن الكريم مزود بجهاز التحكم عن بعد لاختيار القارئ أو السورة والاستماع إلى القرآن بالصوت</p>\r\n\r\n<p>* يسمح مصباح LED المزود بمكبر صوت لترتيل القرآن الكريم بتعلّم القرآن الكريم مع العائلة عند وضعه في الغرفة</p>\r\n\r\n<p>* يتميز بصوت ورنين جميلين لأنه مجهز بمكبر صوت ذي دقة عالية</p>\r\n\r\n<p>تشغّل أي سورة من سور القرآن بالضغط على زر على جهاز التحكم عن بعد.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1165, 583, 1, 'Budi Wall charger with automatic timer', '<p>Wall charger with automatic timer - used to protect against risks that can occur while your phone is charging<br />\r\nIt can be set, for example, to 3 hours, then you connect the phone to the charger and leave it, and it will automatically stop charging after 3 hours<br />\r\nThe charger has two USB ports<br />\r\nWith a charging power of 12 watts and 2.4 amps</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1166, 583, 2, 'شاحن تايمر مؤقت Budi', '<ul>\r\n	<li><strong>شاحن جداري بمؤقت أوتوماتيكي - يستعمل للحماية من المخاطر التي يمكن أن تحصل وهاتفك يشحن لا قدر الله</strong></li>\r\n	<li><strong>يمكن ضبطه&nbsp;</strong><strong>مثلا&nbsp;</strong><strong>على 3 ساعات ثم تقوم بشبك الهاتف بالشاحن وتركه وسوف يقوم من تلقاء نفسه بعد 3 ساعات بالتوقف عن الشحن</strong></li>\r\n	<li><strong>الشاحن يحتوي على منفذين USB</strong></li>\r\n	<li><strong>بقوة شحن 12 وات و 2.4 أمبير</strong></li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1167, 584, 1, 'RAVPower 20W car charger with PD', '<p>RAVPower 20W car charger with PD technology and USB port<br />\r\nEquipped with a 20W USB-C power delivery port, and a 20W USB-A port to charge two devices simultaneously<br />\r\nThe exclusive safety system provides surge protection, temperature control and more - ensuring complete protection for you and your devices.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1168, 584, 2, 'راف باور شاحن سياره 20 واط بتقنية PD', '<ul>\r\n	<li>راف باور شاحن سياره 20 واط بتقنية PD ومنفذ يو اس بي</li>\r\n	<li>مزود بمنفذ توصيل طاقة USB-C بقوة 20 واط ، ومنفذ USB-A بقدرة 20 واط لشحن جهازين في وقت واحد</li>\r\n	<li>يوفر نظام الأمان الحصري حماية من زيادة التيار والتحكم في درجة الحرارة وغير ذلك - مما يضمن الحماية الكاملة لك ولأجهزتك.</li>\r\n</ul>\r\n\r\n<div id=\\\"gtx-trans\\\" style=\\\"position: absolute; left: 85px; top: -6px;\\\">\r\n<div class=\\\"gtx-trans-icon\\\">&nbsp;</div>\r\n</div>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1169, 585, 1, '* LDNIO 36W Smart Wall Charger', '<p>* LDNIO 36W Smart Wall Charger</p>\r\n\r\n<p>Supports Type C fast charging</p>\r\n\r\n<p>Qualcomm PD and USB 3.0 - Enables two Type C and USB 3.0 ports</p>\r\n\r\n<p>Charge multiple devices at once.</p>\r\n\r\n<p>- Automatically detects the connected device to provide the optimal required charge. -</p>\r\n\r\n<p>Provides protection against over-voltage, over-current, over-charging, over-heating and short-circuiting.</p>\r\n\r\n<p>- Durable construction for long life. Sleek and elegant design.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1170, 585, 2, 'شاحن سريع منزلي PD من LDNIO', '<p>*شاحن جداري ذكي من LDNIO 36W</p>\r\n\r\n<p>يدعم الشحن السريع تايب سي</p>\r\n\r\n<p>PD و USB كوالكم 3.0 - يتيح منفذي Tybe C و USB 3.0</p>\r\n\r\n<p>شحن العديد من الأجهزة في آن واحد.</p>\r\n\r\n<p>- يكتشف تلقائياً الجهاز المتصل ليقدم الشحن المطلوب الأمثل. -</p>\r\n\r\n<p>يوفر الحماية ضد الجهد الزائد، والإفراط في التيار، والإفراط في الشحن، والإفراط في الحرارة وقصر الدائرة.</p>\r\n\r\n<p>- هيكل متين يطيل العمر. تصميم أنيق وراقي.</p>\r\n\r\n<div id=\\\"gtx-trans\\\" style=\\\"position: absolute; left: 54px; top: 225px;\\\">\r\n<div class=\\\"gtx-trans-icon\\\">&nbsp;</div>\r\n</div>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1171, 586, 1, 'Vidvie Car Charger', '<p>White color</p>\r\n\r\n<p>2 exit</p>\r\n\r\n<p>Compatible with all types of mobiles</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1172, 586, 2, 'شاحن سيارة  Vidvie', '<p>لون ابيض&nbsp;</p>\r\n\r\n<p>2 مخرج&nbsp;</p>\r\n\r\n<p>متوافق مع كل أنواع الجوالات&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1173, 587, 1, 'Wopow Car Charger', '<p>An upgraded smart car charger that has an IQ feature to identify the device type with a multi-tasking smart protection chip IC to protect against overvoltage, discharge, heat and short circuit. It contains ceramic with polycarbonate, as used in Apple devices, polished with a white balloon that is resistant to fire and vibrations</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1174, 587, 2, 'شاحن سيارة Wopow', '<p>شاحن سيارة ذكي مطور يحتوي على خاصية IQ للتعرف على نوع الجهاز مع رقاقة الحماية الذكية IC المتعددة المهام للحماية من الفولت الزائد والتفريغ والحرارة والألتماس . يحتوي على السيراميك مع بولي كاربونات كما هوة مستخدم في أجهزة أبل مسقول بالون الأبيض مقاوم للحريق و للأهتزازات</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1175, 588, 1, 'Spark Berry Car Charger', '<p>Equipped with I-SMART<br />\r\nEquipped with MASS MAX<br />\r\nMade of aluminum.<br />\r\n30W charger to charge your phone quickly and safely<br />\r\nOvercurrent protection.<br />\r\nHigh voltage protection.<br />\r\nShort circuit protection.<br />\r\nPhone overcharge protection.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1176, 588, 2, 'شاحن سيارة Spark Berry', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>مزود بخاصية&nbsp;<strong>I-SMART</strong></li>\r\n	<li>مزود بخاصية&nbsp;<strong>MASS MAX</strong></li>\r\n	<li>مصنع من الألمنيوم.</li>\r\n	<li>شاحن بقوة 30 وات لشحن الهاتف بشكل سريع وآمن</li>\r\n	<li>حماية من التيار الكهربائي العالي.</li>\r\n	<li>حماية من الجهد العالي.</li>\r\n	<li>حماية من تقصير الدائرة الكهربائية.</li>\r\n	<li>حماية من الشحن الزائد للهاتف.</li>\r\n</ul>\r\n\r\n<div id=\\\"gtx-trans\\\" style=\\\"position: absolute; left: 35px; top: 38px;\\\">\r\n<div class=\\\"gtx-trans-icon\\\">&nbsp;</div>\r\n</div>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1177, 589, 1, 'Wopow Power Bank 10000 Mah', '<p>Powerful 10000 mAh<br />\r\nCharges more than 500 times</p>\r\n\r\n<div id=\\\"gtx-trans\\\" style=\\\"position: absolute; left: 86px; top: 14px;\\\">\r\n<div class=\\\"gtx-trans-icon\\\">&nbsp;</div>\r\n</div>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
