(1179, 590, 1, 'Huawei Type C Charger', '<p>Supports 40W fast charging technology with one USB port</p>\r\n\r\n<p>Compatible with smartphones and laptops</p>\r\n\r\n<p>Multiple protection Supports over current and over voltage protection&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1180, 590, 2, 'شاحن هواوي تايب سي', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;يدعم تقنية الشحن السريع بقوة 40 واط بمنفذUSB واحد</p>\r\n\r\n<p>متوافق مع اجهزة الهواتف الذكية واجهزة الكمبيوتر المحمولة</p>\r\n\r\n<p>حماية متعددة &nbsp;يدعم الحماية من التيار العالي والفولت العالي&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1181, 591, 1, 'iPhone charger head', '<p>wall charger head</p>\r\n\r\n<p>20 watts</p>\r\n\r\n<p>White color</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1182, 591, 2, 'رأس شاحن أيفون', '<p>رأس شاحن جداري&nbsp;</p>\r\n\r\n<p>بقوة 20 واط&nbsp;</p>\r\n\r\n<p>لون أبيض&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1183, 592, 1, 'Ldnio Desktop Charger', '<p>Perfect desktop charging base<br />\r\nEight USB charging ports for 8 devices<br />\r\nSupport QC3.0/2.0 . fast charging<br />\r\nDual voltage 100V~240V.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1184, 592, 2, 'قاعدة شحن متعدد Ldnio', '<p>قاعدة شحن مثالية لسطح المكتب</p>\r\n\r\n<p>ثماني منافذ شحن يو اس بي لـ 8 أجهزة</p>\r\n\r\n<p>يدعم الشحن السريع QC3.0/2.0</p>\r\n\r\n<p>جهد كهربائي مزدوج 100 فولت ~ 240 فولت.</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
