(1187, 594, 1, 'Power Bank Bod 6000', '<p>Power bank with a capacity of 6000 mAh<br />\r\nA high quality power bank with IECEE certification and SASO certification<br />\r\nSoft texture, small size, elegant design<br />\r\nIt has a USB output port with Q3.0 . power<br />\r\nIt has a Type C port<br />\r\nIt has a micro-input port<br />\r\nA side signal with four stages that determines the percentage of charging in the bank<br />\r\nComes with the portable charger, a micro cable of half a meter<br />\r\nComes with a portable charger and a stylish case</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1188, 594, 2, 'باور بانك بود 6000', '<ul>\r\n	<li><strong>اور بانك</strong>&nbsp;بسعة 6000 ملي امبير بود bod</li>\r\n	<li><strong>باور بانك</strong>&nbsp;ذات جوده عاليه حاصله على شهادة IECEE وشهادة المواصفات والمقاييس السعوديه SASO</li>\r\n	<li>ناعمة الملمس صغيرة الحجم اناقة التصميم</li>\r\n	<li>يحتوي على منفذ اخراج USB بقوة Q3.0&nbsp;</li>\r\n	<li>يحتوي على منفذ تايب سي&nbsp; ادخال&nbsp;</li>\r\n	<li>يحتوي على منفذ ميكرو ادخال&nbsp;</li>\r\n	<li>اشاره جانبيه باربع مراحل تحدد نسبة الشحن بالبوربنك</li>\r\n	<li>يأتي مع الشاحن المتنقل كيبل ميكرو بطول نص متر&nbsp;</li>\r\n	<li>يأتي مع الشاحن المتنقل حافظه انيقه&nbsp;</li>\r\n</ul>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1189, 595, 1, 'Gulf Power Bank 10000 mAh', '<p>Gulf Power Bank 10000 mAh - White - G56</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1190, 595, 2, 'باور بانك من جولف بقوة 10000 ملي امبير -', '<p>باور بانك من جولف بقوة 10000 ملي امبير - ابيض - G56</p>\r\n\r\n<div id=\\\"gtx-trans\\\" style=\\\"position: absolute; left: 145px; top: 38px;\\\">\r\n<div class=\\\"gtx-trans-icon\\\">&nbsp;</div>\r\n</div>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1191, 596, 1, 'Power Bank Bod 20000', '<p>Portable charger with a capacity of 20000 mAh Bod<br />\r\nHigh quality portable charger with IECEE certification and SASO certification<br />\r\nSoft texture, small size, elegant design<br />\r\nIt has two USB output ports, a Q3.0 port and a 2.1A port<br />\r\nIt has a Type C PD port, input and output, with a power of 18W<br />\r\nIt has a micro-input port<br />\r\nA side signal with four stages that determines the percentage of charging in the bank<br />\r\nComes with the portable charger, a micro cable, half a meter long<br />\r\nComes with a portable charger and a stylish case</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1192, 596, 2, 'باور بانك بود 20000', '<ul>\r\n	<li><strong>شاحن متنقل</strong>&nbsp;بسعة 20000 ملي امبير بود bod</li>\r\n	<li><strong>شاحن متنقل</strong>&nbsp;ذات جوده عاليه حاصله على شهادة IECEE وشهادة المواصفات والمقاييس السعوديه SASO</li>\r\n	<li>ناعمة الملمس صغيرة الحجم اناقة التصميم</li>\r\n	<li>يحتوي على منفذين اخراج USB منفذ بقوة Q3.0 ومنفذ 2.1A</li>\r\n	<li>يحتوي على منفذ تايب سي PD ادخال واخراج بقوة 18W</li>\r\n	<li>يحتوي على منفذ ميكرو ادخال&nbsp;</li>\r\n	<li>اشاره جانبيه باربع مراحل تحدد نسبة الشحن بالبوربنك</li>\r\n	<li>ياتي مع الشاحن المتنقل كيبل ميكرو بطول نص متر&nbsp;</li>\r\n	<li>يأتي مع الشاحن المتنقل حافظه انيقه</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1193, 597, 1, 'Bod Power Bank 10000', '<p>Power bank with a capacity of 10000 mAh<br />\r\nA high quality power bank with IECEE certification and SASO certification<br />\r\nSoft texture, small size, elegant design<br />\r\nIt has two USB output ports, a Q3.0 port and a 2.1A port<br />\r\nIt has a Type C PD port, input and output, with a power of 18W<br />\r\nIt has a micro-input port<br />\r\nA side signal with four stages that determines the percentage of charging in the bank<br />\r\nComes with the portable charger, a micro cable of half a meter<br />\r\nComes with a portable charger and a stylish case</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL);
