(1197, 599, 1, 'Active Power Bank 20000 Mah', '<p>Power Bank from Active, a company specialized in the field of mobile phones</p>\r\n\r\n<p>Amber 20 mobile battery in oil color<br />\r\nWith two USB ports and a Type-C port for charging smart phones.<br />\r\nAnd you can recharge the mobile battery through the Micro port and the Type-C port.<br />\r\nIt is allowed to be carried by plane.<br />\r\nPD technology to super-fast charge iPhone from 0% to 50% within 30 minutes.<br />\r\nAnd QC3.0 charging technology for Android devices.<br />\r\nAnd IQ technology for smart tariff that gives the mobile the energy it needs.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1198, 599, 2, 'باور بانك أكتف 20000 مللي امبير', '<p>باور بنك من شركة اكتف المتخصصة في مجال اكسسوارات الهواتف النقالة</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>بطارية امبر 20 المتنقلة</li>\r\n	<li>بمنفذين USB A ومنفذ Type-C لشحن الهوتف الذكية.</li>\r\n	<li>وتستطيع اعادة شحن البطارية المتنقلة عن طريق منفذ الـ Micro ومنفذ الـ Type-C.</li>\r\n	<li>مسموح حملها بالطائرة,,</li>\r\n	<li>تتميز بتقنية PD لشحن الآيفون بسرعة فائقة من 0% الى 50% خلال 30 دقيقة.</li>\r\n	<li>وتقنية الـ QC3.0 للشحن الامن لاجهزة الاندرويد.</li>\r\n	<li>وتقنية الـ IQ للتعرفة الذكية اللي تعطي الجوال الطاقة اللي يحتاجها.</li>\r\n	<li>السعة 20,000 ملي أمبير</li>\r\n</ul>\r\n\r\n<div id=\\\"gtx-trans\\\" style=\\\"position: absolute; left: 102px; top: 104px;\\\">\r\n<div class=\\\"gtx-trans-icon\\\">&nbsp;</div>\r\n</div>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
