(1211, 606, 1, 'Car charger wopow', '<p>An upgraded smart car charger that has an IQ feature to identify the device type with a multi-tasking smart protection chip IC to protect against overvoltage, discharge, heat and short circuit. It contains ceramic with polycarbonate, as used in Apple devices, polished with a white balloon that is resistant to fire and vibrations</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
