(1213, 607, 1, 'Crave Power Bank 5200 Mah', '<p>It maximizes the optimal power capacity that keeps your device running at all times<br />\r\nCompact design and large capacity battery make it the perfect travel companion<br />\r\nIt includes a well-designed internal circuit that prevents sudden shocks</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1214, 607, 2, 'باور بانك كريف 5200 مللي امبير', '<p>يعمل على زيادة سعة الطاقة المثالية التي تحافظ على تشغيل جهازك في جميع الأوقات<br />\r\nتصميم صغير وبطارية بسعة كبيرة تجعله الرفيق الأمثل في السفر<br />\r\nيتضمن مجموعة دوائر داخلية مصمَّمة جيداً بحيث تمنع الصدمات المفاجئة</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1215, 608, 1, 'Active Power Bank 5000 Mah', '<p>symmetrical design<br />\r\nIt is allowed to be carried by plane<br />\r\nSupports Power boost technology to provide high quality and safe charging.<br />\r\nAnd IQ technology for smart tariff that gives the mobile the energy it needs.<br />\r\nPower 12 watts.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1216, 608, 2, 'باور بانك أكتف 5000 مللي امبير', '<ul>\r\n	<li>تصميم متناسق</li>\r\n	<li>مسموح حملها بالطائرة</li>\r\n	<li>تدعم تقنية الـ Power boost لتوفر جودة عالية و أمان في الشحن.</li>\r\n	<li>وتقنية الـ IQ للتعرفة الذكية اللي تعطي الجوال الطاقة اللي يحتاجها.</li>\r\n	<li>قوة 12 واط.</li>\r\n</ul>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1219, 610, 1, 'ZTE Router wifi 5G', '<p>The all-new ZTE 5G Wireless Router is equipped with advanced technologies that deliver improved wireless connectivity. This wireless router offers just that high speed to make sure that the router meets the needs of even the most demanding internet applications. The ZTE 5G Wireless Router is designed with an exceptional range of Wi-Fi coverage. In addition, never worry about users&#39; restrictions on using this ZTE 5G Wireless Router up to 64 users. Unlock the SIM card for all telecom companies</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1220, 610, 2, 'راوتر ZTE Wifi 5G', '<p>تم تجهيز جهاز التوجيه اللاسلكي ZTE 5G الجديد كليًا بتقنيات متقدمة توفر اتصالاً لاسلكيًا محسنًا. يوفر هذا الموجه اللاسلكي هذه السرعة العالية فقط للتأكد من أن الموجه يلبي احتياجات حتى تطبيقات الإنترنت الأكثر تطلبًا. تم تصميم جهاز التوجيه اللاسلكي ZTE 5G بنطاق استثنائي من تغطية Wi-Fi. بالإضافة إلى ذلك ، لا تقلق أبدًا بشأن قيود المستخدمين على استخدام هذا الموجه اللاسلكي ZTE 5G حتى 64 مستخدمًا. فتح بطاقة SIM لجميع شركات الاتصالات</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
