(1230, 615, 2, 'حامل جوال متعدد الإستخدامات  OneDer V02', '<p>حامل للجوال&nbsp;&nbsp;</p>\r\n\r\n<p>شاحن لاسلكي&nbsp;</p>\r\n\r\n<p>سماعة سبيكر&nbsp;</p>\r\n\r\n<p>ومنبة&nbsp;</p>\r\n\r\n<div id=\\\"gtx-trans\\\" style=\\\"position: absolute; left: 12px; top: 137px;\\\">\r\n<div class=\\\"gtx-trans-icon\\\">&nbsp;</div>\r\n</div>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1231, 616, 1, 'Micro Digit Speaker', '<p>Brand: MICRODIGIT<br />\r\nCommunication methods: wired / wireless<br />\r\nHeadphones Type: Bluetooth Headphones<br />\r\nCompatible with : Multi<br />\r\nInput type: AUX<br />\r\nProduction capacity: 10 - 20 watts</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1232, 616, 2, 'سماعات مايكرو ديجيت سبيكر', '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>العلامة التجارية : MICRODIGIT</li>\r\n	<li>طرق الاتصال : سلكي/لاسلكي</li>\r\n	<li>نوع السماعات : سماعات بلوتوث</li>\r\n	<li>متوافق مع : متعدد</li>\r\n	<li>نوع المدخل : ايه يو اكس</li>\r\n	<li>القدرة الإنتاجية : 10 - 20 واط</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1233, 617, 1, 'Portable quran speaker sq 112 touch lamp', '<p>Description of the illuminated Quran headset:-</p>\r\n\r\n<p>The entire Qur&rsquo;an, with the voice of a selection of the most famous reciters:<br />\r\n-Abdullrahman Alsudais.</p>\r\n\r\n<p>Saud Al-Shuraim.</p>\r\n\r\n<p>-Maher Almaikulai.</p>\r\n\r\n<p>-Saad Al-Ghamdi.</p>\r\n\r\n<p>-Mohammed Siddiq Al-Minshawi with the children.</p>\r\n\r\n<p>-Abdul Basit Abdul Samad.</p>\r\n\r\n<p>- Mishary bin Rashid Al-Afasy.</p>\r\n\r\n<p>Hani Al-Rifai.</p>\r\n\r\n<p>Abdul Rahman Al-Hudhaifi.</p>\r\n\r\n<p>Muhammad Ibrahim.</p>\r\n\r\n<p>Muhammad Siddiq Al-Minshawi.</p>\r\n\r\n<p>Ibrahim Al-Akhdar.</p>\r\n\r\n<p>-Mohamed Ayoub.</p>\r\n\r\n<p>Mahmoud Khalil Al-Hosary.</p>\r\n\r\n<p>The property of repeating the surahs and verses.<br />\r\nSahih al-Bukhari and Sahih al-Muslim.<br />\r\nThe Way of Prayer - Al-Qaida Al-Nooraniah - Fortress of the Muslim.<br />\r\nIt also contains 40 hadiths.<br />\r\nInterpretation of the two.<br />\r\nTranslation of the entire Holy Quran for non-Arabic speakers.<br />\r\nInterpretation of the Holy Quran in full.<br />\r\nThe teacher recited the verses of the Noble Qur&rsquo;an for the memorization of the Qur&rsquo;an for young children.<br />\r\nRemote control and the ability to choose the fence quickly and smoothly.<br />\r\nSpecial buttons for the fence to move to and hear it directly.<br />\r\nA selection of the most beautiful Islamic songs.<br />\r\nSpell legitimacy for the most famous readers.<br />\r\nMorning and Evening Prayers.<br />\r\nPrayer.<br />\r\nModern high quality headphone without any noise.<br />\r\nLighting that works and changes by touch (6 colors).<br />\r\nThe possibility of using the lighting without turning on the sound.<br />\r\nThe ability to hear the Noble Qur&rsquo;an without lighting.<br />\r\nIt works on 220 and 110 electricity.<br />\r\nPowered by charging, the headset can be charged for 40 minutes and works for 9 hours.<br />\r\nThe possibility of operating the speaker 24 hours and it is connected to the charging power cord.<br />\r\nBluetooth feature to listen to any content on the phone.<br />\r\nAUX input for the phone.<br />\r\nFM Radio.<br />\r\nBuilt-in internal memory, loaded with the Holy Quran, complete ready.<br />\r\nSuitable for memorizing the Holy Quran for young and old.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1234, 617, 2, 'سماعه القرآن المضيئة SQ 112', '<p><strong>وصف&nbsp;سماعة القران المضيئة:-</strong></p>\r\n\r\n<ul>\r\n	<li><strong>القران كاملا بصوت نخبة من أشهر القراء:</strong></li>\r\n</ul>\r\n\r\n<p><strong>-عبد الرحمن السديس.</strong></p>\r\n\r\n<p><strong>-سعود الشريم.</strong></p>\r\n\r\n<p><strong>-ماهر المعيقلي.</strong></p>\r\n\r\n<p><strong>-سعد الغامدي.</strong></p>\r\n\r\n<p><strong>-محمد صديق المنشاوي مع الأطفال.</strong></p>\r\n\r\n<p><strong>-عبد الباسط عبد الصمد.</strong></p>\r\n\r\n<p><strong>-مشاري بن راشد العفاسي.</strong></p>\r\n\r\n<p><strong>-هاني الرفاعي.</strong></p>\r\n\r\n<p><strong>-عبد الرحمن الحذيفي.</strong></p>\r\n\r\n<p><strong>-محمد أبراهيم.</strong></p>\r\n\r\n<p><strong>-محمد صديق المنشاوي.</strong></p>\r\n\r\n<p><strong>-أبراهيم الأخضر.</strong></p>\r\n\r\n<p><strong>-محمد أيوب.</strong></p>\r\n\r\n<p><strong>-محمود خليل الحصري.</strong></p>\r\n\r\n<ul>\r\n	<li><strong>خاصية تكرار السور و الايات.</strong></li>\r\n	<li><strong>صحيح البخاري و صحيح المسلم.</strong></li>\r\n	<li><strong>طريقة الصلاة - القاعدة النورانية - حصن المسلم.</strong></li>\r\n	<li><strong>كما تحتوي على 40 حديث شريف.</strong></li>\r\n	<li><strong>تفسير الجلالين.</strong></li>\r\n	<li><strong>ترجمة القران الكريم كاملا للناطقين بغير العربية.</strong></li>\r\n	<li><strong>تفسير القران الكريم كاملا.</strong></li>\r\n	<li><strong>المصحف المعلم ترديد ايات القران الكريم لتحفيظ القران للصغار.</strong></li>\r\n	<li><strong>ريموت للتحكم عن بعد و امكانية اختيار السور بسرعة و سلاسة.</strong></li>\r\n	<li><strong>ازرار خاصة بالسور للانتقال اليها وسماعها بشكل مباشر.</strong></li>\r\n	<li><strong>نخبة مختارة من اجمل الاناشيد الاسلامية.</strong></li>\r\n	<li><strong>الرقية الشرعية لأشهر القراء.</strong></li>\r\n	<li><strong>أذكار الصباح و المساء.</strong></li>\r\n	<li><strong>دعاء.</strong></li>\r\n	<li><strong>سماعة حديثة بجودة عاالية دون أي ضجيج.</strong></li>\r\n	<li><strong>اضاءة تعمل و تتغير باللمس (6 ألوان ) .</strong></li>\r\n	<li><strong>امكانية استخدام الاضاءة بدون تش