(1287, 644, 1, 'Cara 12 in 1 Mobile Protection Set for iPhone', '<p>The strongest protection package from the brand KARA to fully protect the mobile and in various types of the most famous original international brands specialized in mobile protection</p>\r\n\r\n<p>transparent protective cover<br />\r\nfront protection sticker<br />\r\nBack protection sticker with sides<br />\r\nBack camera protection sticker<br />\r\n360 mobile phone holder original<br />\r\npencil<br />\r\nA piece of the charger&#39;s housing after the completion of charging (protector from dust)<br />\r\n1 . car holder<br />\r\n2 . car holder<br />\r\nring<br />\r\nRope</p>\r\n\r\n<p><br />\r\nauxiliary tools</p>\r\n\r\n<p>Stickers installation tools:<br />\r\nA piece to install the device during the installation of stickers<br />\r\nSticker to remove air from the sticker<br />\r\nCleaning Tools</p>\r\n\r\n<p>Compatible with models from iPhone 11 to iPhone 12 Promax</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1288, 644, 2, 'مجموعة الحماية للجوال من كارا 12 في 1 للأيفون', '<p><strong>اقوى بكج حماية من ماركة كارا KARA لحماية الجوال بالكامل وبأنواع متعددة من أشهر الماركات العالمية الاصلية المتخصصة بحماية الجوال</strong></p>\r\n\r\n<ul>\r\n	<li><strong>كفر حماية شفاف</strong></li>\r\n	<li><strong>استيكر الحماية الامامي</strong></li>\r\n	<li><strong>استيكر حماية خلفي مع الجوانب</strong></li>\r\n	<li><strong>استيكر حماية للكاميرا الخلفية</strong></li>\r\n	<li><strong>مسكه جوال أصلية متحركه 360</strong></li>\r\n	<li><strong>قلم</strong></li>\r\n	<li><strong>قطعة تسكير بيت الشاحن بعد الانتهاء من الشحن ( حامي من الغبار )</strong></li>\r\n	<li><strong>حامل سيارة 1</strong></li>\r\n	<li><strong>حامل سيارة 2</strong></li>\r\n	<li><strong>حلقة</strong></li>\r\n	<li><strong>حبل</strong></li>\r\n</ul>\r\n\r\n<p><strong>﻿</strong></p>\r\n\r\n<p><strong>ادوات مساعدة</strong></p>\r\n\r\n<ul>\r\n	<li><strong>أدوات لتركيب الاستيكرات :</strong></li>\r\n	<li><strong>قطعة لتثبيت الجهاز اثناء تركيب الاستيكرات</strong></li>\r\n	<li><strong>بطاقة لإزالة الهواء من الاستيكر</strong></li>\r\n	<li><strong>أدوات تنظيف</strong></li>\r\n</ul>\r\n\r\n<p>متوافقة مع موديلات من أيفون 11 إلى أيفون 12 Promax</p>\r\n\r\n<p>&nbsp;</p>', NULL, 0, NULL, 0, 0, NULL, 0, 0),
(1289, 645, 1, 'Apple Earpods 1', '<p>Revel in the latest advancements in the sound gear technology space with the Apple Wireless AirPods. These wireless headphones are going to change the way you listen to music forever. As soon as you take these AirPods out of the charging case and put them in your ears, there is an automatic connection. The music starts and the second you take them off, it stops. Communicating with your favorite personal assistant is a breeze with these Airpods. Double tap either of the AirPod to activate Siri, without requiring to take your iPhone out of your pocket. They are available in a classy white color.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1290, 645, 2, 'ابل ايربودز الإصدار الأول', '<p>عش تجربة رائعة بأحدث وآخر التطورات في تقنية عالم الصوتيات مع سماعات الأذن ابل اير بودز اللاسلكية Apple Wireless AirPods. ستغير سماعات ابل اللاسلكية إلى الأبد الطريقة التي تستمع بها إلى الموسيقى. فحالما تخرج السماعات من محفظة الشحن الخاصة بها، وتضعها على اذنيك، ستستمتع باتصال اوتوماتيكي،بحيث سيبدا تشغيل الموسيقى على الفور، وعندما نزع السماعات من على أذنيك، ستتوقف الموسيقى. ستتمكن بسهولة من التواصل مع مساعدك الشخصي الصوتي المفضل لديك على هاتفك مع سماعات الاذن ابل. قم بالنقر بشكل مزدوج على احدى سماعات الاير بودز لتفعل المساعد الشخصي سيري Siri، بدون الحاجة إلى إخراج الايفون الخاص بك من جيبك. تتوفر سماعات الأذن ابل اير بودز باللون الأبيض الأنيق.</p>\r\n\r\n<p>الاصدار الاول</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1291, 646, 1, 'Apple Earpods 2', '<p>The new AirPods bear the same design as the first version, but Apple has provided the new generation or AirPods 2 with the H1 chip of its design instead of the W1 of the Apple Watch, which Apple says provides longer battery life, about 50% more than hours of voice calls compared to With the first generation, it also allows support for the Hey Siri feature, which enables the user to communicate directly by voice and request the implementation of voice commands via Siri, in addition to support for Bluetooth 5.0.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1292, 646, 2, 'ابل ايربودز الإصدار الثاني', '<p>تحمل سماعات ايربودز الجديدة نفس تصميم الإصدار الأول تماما، لكن آبل زودت الجيل الجديد أو AirPods 2 برقاقة H1 من تصميمها بدلا من W1 الخاصة بساعة ابل الذكية&nbsp;<strong><a href=\\\"https://tech-echo.com/2018/09/apple-watch-series-4-features-price/\\\" target=\\\"_blank\\\">Apple Watch</a></strong>، والتي تقول آبل أنها توفر عمر بطارية أطول، حوالي 50% أكثر من ساعات المكالمات الصوتية مقارنة مع الجيل الأول، كما تتيح دعم ميزة Hey Siri التي تمكن المستخدم من التواصل صوتيا مباشرة وطلب تنفيذ الأوامر الصوتية عبر سيري، بالإضافة لدعم<strong><a href=\\\"https://tech-echo.com/2016/12/bluetooth-5-ready-to-use-features/\\\" target=\\\"_blank\\\">&nbsp;بلوتوث 5.0</a></strong>.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1293, 647, 1, 'Stylus pen', '<p>Perfect for taking notes, drawing, writing and signing on any smartphones and tablets.<br />\r\nPen Length: 145mm, Diameter: 9mm, Pen Tip: 1.45mm<br />\r\nMetal pen made of aluminum alloy<br />\r\nBuilt-in battery, charging via USB port</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1294, 647, 2, 'قلم stylus', '<p>مثالي لتدوين الملاحظات والرسم والكتابة والتوقيع على أي هواتف ذكية وأجهزة لوحية.<br />\r\nطول القلم: 145 ملم ، القطر: 9 ملم ، طرف القلم: 1.45 ملم<br />\r\nقلم معدني مصنوع من سبائك الألومنيوم<br />\r\n&nbsp;بطارية مدمجة ، يتم الشحن عن طريق منفذ USB</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
