(1304, 652, 2, 'راوتر ZTE myfi 5G', '<p>اكتشف متعة الحياة السهلة مع الإتصال السريع عند استخدامك الراوتر المحمول الداعم للجيل الخامس من العلامة التجارية زي تي اي. معد بأحدث التقنيات التي تدعم الاتصال السريع. زود الراوتر الجديد هذا من العلامة التجارية زي تي اي بشاشة تعمل باللمس لتضمن لك راحتك</p>\r\n\r\n<p>مفتوح لكل الشبكات</p>\r\n\r\n<p>يدعم مخرج usb ومخرج dsi</p>\r\n\r\n<p>بطارية بقوة 4500 mah</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1305, 653, 1, 'Playstation 5 , Sony + CD', '<p>Graphics Processor: AMD Radeon RDNA 2 with performance up to 10.3 teraflops<br />\r\nRAM: 16GB GDDR6, 448Gbps data transfer rate<br />\r\nStorage: 825GB SSD, 5.5Gbps.<br />\r\nVideo: Support for connection to screens with a resolution of up to 4K at a frequency of 120 Hz, in addition to support for connection to TVs with a resolution of 8K.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL),
(1306, 653, 2, 'بلاي ستيشن 5 ، سوني +CD', '<p>المعالج: AMD Zen 2 ثماني النواة بتردد متغير حتى 3.5 جيجاهرتز<br />\r\nمعالج الرسوميات: AMD Radeon RDNA 2 بأداء يصل إلى 10.3&nbsp;تيرافلوبس<br />\r\nذاكرة الوصول العشوائي: GDDR6 بسعة 16 جيجابايت، بمعدل نقل بيانات 448 جيجابت/الثانية<br />\r\nالمساحة التخزينية: SSD بسعة 825 جيجابايت، بسرعة 5.5 جيجابت/الثانية.&nbsp;<br />\r\nالفيديو: دعم التوصيل بشاشات بدقة حتى 4K بتردد 120 هرتز، بالإضافة لدعم التوصيل بالتلفزيونات بدقة 8K.</p>', NULL, 0, '', NULL, NULL, '', NULL, NULL);
